INSERT INTO `TaiNguyenSach` VALUES (1,'Bộ Luật Hình Sự Hiện Hành (Bộ Luật Năm 2015, Sửa Đổi, Bổ Sung Năm 2017)','NXB Chính Trị Quốc Gia Sự Thật',2017,'Tiếng Việt','Bộ Luật Hình Sự Hiện Hành (Bộ Luật Năm 2015, Sửa Đổi, Bổ Sung Năm 2017) với các quy định mới về tội phạm; những trường hợp loại trừ trách nhiệm hình sự; thời hiệu truy cứu trách nhiệm hình Bộ luật hình sự được áp dụng đối với mọi hành vi phạm tội thực hiện trên lãnh thổ nước Cộng hòa xã hội chủ nghĩa Việt Nam.','LVBL',3,'302','302-1'),(2,'Bộ Luật Dân Sự (Hiện Hành)','NXB Chính Trị Quốc Gia Sự Thật',2019,'Tiếng Việt','Bộ luật dân sự bao gồm 689 điều, có những nội dung nổi bật về chuyển đổi giới tính. Thực hiện hợp đồng khi hoàn cảnh thay đổi cơ bản. Các nghĩa vụ tài sản và các khoản chi phí liên quan đến thừa kế...','LVBL',3,'302','302-1'),(3,'Hướng Dẫn Thi Hành Luật Đất Đai – Luật Nhà Ở – Tăng Cường Chấn Chỉnh Công Tác Quản Lý Nhà Nước Về Giá Đất, Tiền Thuê Đất, Cấp Đổi Sổ, Bồi Thường, Hỗ Trợ, Tái Định Cư Khi Nhà Nước Thu Hồi Đất','NXB Lao Động',2021,'Tiếng Việt','Ngày 04-5-2021, Bộ Tài nguyên và Môi trường ban hành Văn bản hợp nhất số 04/VBHN-BTNMT Hợp nhất Nghị định quy định chi tiết thi hành một số điều của Luật Đất đai. Ngày 26-3-2021, Chính phủ ban hành Nghị định 30/2021/NĐ-CP sửa đổi, bổ sung một số điều của Nghị định 99/2015/NĐ-CP quy định chi tiết và hướng dẫn thi hành một số điều của Luật Nhà ở. Theo đó: Bổ sung quy định về việc điều chỉnh chương trình, kế hoạch phát triển nhà ở của địa phương; Sửa quy định về lấy ý kiến thẩm định của cơ quan nhà nước về nhà ở đối với dự án đầu tư xây dựng nhà ở, các trường hợp lựa chọn chủ đầu tư dự án xây dựng nhà ở thương mại, dự án khu đô thi có nhà, bàn giao kinh phí bảo trì phần sở hữu chung của nhà chung cư có nhiều chủ sở hữu…','LVBL',3,'302','302-1'),(4,'Nhận Diện Rủi Ro Trong Mua Bán Nhà Đất','NXB Chính Trị Quốc Gia Sự Thật',2021,'Tiếng Việt','Hiện nay, nhu cầu về nhà đất ngày một gia tăng, thị trường bất động sản nước ta vô cùng sôi động, có sức hút lớn đối với các nhà đầu tư. Tuy nhiên, vì những lý do khác nhau, trong giao dịch mua bán nhà đất, nhiều người chưa nắm vững các quy định của pháp luật nên dễ gặp phải rủi ro pháp lý, thiệt hại về tài sản trong việc chuyển nhượng, nhận chuyển nhượng nhà ở, quyền sử dụng đất (mua bán nhà đất).','LVBL',3,'302','302-1'),(5,'Thời Dựng Đảng','NXB Tổng hợp TP.HCM',2013,'Tiếng Việt','Cả một thời kỳ thai nghén, mang nặng, đẻ đau, đã quyết định tính chất và vai trò của Đảng, hướng đi lên chính xác của đất nước, cái kiên và cái cường của phong trào, độ vững và sức bật của dân tộc và mỗi con người... Lúc này đây, đang có một sự khao khát trở về nguồn để bồi dưỡng cho mình sức mạnh đi tới, khi đến lượt chúng ta đây vươn cao lên để giải quyết tổng hợp những nhiệm vụ nặng nề và rộng lớn của thời kỳ mới, trực tiếp thực hiện những điều mơ ước - vì nó mà sống và chết - của những người cộng sản Việt Nam thuộc lớp đầu tiên','LLCT',3,'302','302-1'),(6,'Chỉ Dẫn Áp Dụng Luật Đất Đai Và Văn Bản Hướng Dẫn Chi Tiết Thi Hành (Theo Nghị định số 148/2020/NĐ-CP ngày 18/12/2020)','NXB Hồng Đức',2021,'Tiếng Việt','Nhằm giúp các tổ chức, cá nhân tìm hiểu và áp dụng đúng những quy định mới nhất của Nhà nước về đất đai, cụ thể: Những hành vi vi phạm pháp luật về đất đai, xây dựng, nhà ở; những quy định về xác định giá đất; thu tiền thuê đất, sử dụng đất; quy định về quản lý, sử dụng đất trồng lúa;…Nhà xuất bản Hồng Đức phối hợp cùng với giới thiệu cuốn sách: Chỉ Dẫn Áp Dụng Luật Đất Đai Và Văn Bản Hướng Dẫn Chi Tiết Thi Hành (Theo Nghị định số 148/2020/NĐ-CP ngày 18/12/2020)','LVBL',3,'302','302-1'),(7,'Từ điển pháp luật Việt Nam','NXB Thế Giới',2020,'Tiếng Việt','Với mong muốn có một cuốn sách có thể đáp ứng nhu cầu tìm hiểu các từ ngữ pháp luật một cách có hệ thống, nhằm tạo thuận lợi cho những người làm công tác nghiên cứu, học tập và áp dụng pháp luật, tác giả đã dành thời gian hơn 20 năm với nhiều tâm huyết để thu thập, sưu tầm và biên soạn cuốn sách này. Có thể nói đây là công trình mang tính khoa học có giá trị, được biên soạn khá công phu với số lượng từ ngữ pháp luật Việt Nam nhiều nhất cho đến thời điểm hiện tại (5.665 từ). Đồng thời đây cũng là cuốn Từ điển pháp luật đầu tiên của Việt Nam do một cá nhân biên soạn.','LVBL',3,'302','302-1'),(8,'Phương Pháp Nghiên Cứu Và Đánh Giá Chứng Cứ Trong Tố Tụng Hình Sự Và Các Văn Bản Hướng Dẫn Thi Hành Bộ Luật Tố Tụng Hình Sự Mới Nhất','NXB Lao Động',2019,'Tiếng Việt','Trong tố tụng hình sự thì hoạt động nghiên cứu, đánh giá chứng cứ có vai trò rất quan trọng, đây là những hoạt động trọng tâm của tố tụng hình sự. Bởi lẽ tất cả các hoạt động tố tụng hình sự ở giai đoạn điều tra, truy tố, xét xử xét cho cùng đều phải đi đến kết luận về giá trị chứng minh của chứng cứ, trên cơ sở đó mới có thể chứng minh một tội phạm nào đó đã được thực hiện và ai là người đã thực hiện tội phạm đó. Vấn đề nghiên cứu, đánh giá chứng cứ tuy không được quy định cụ thể thành một quy trình trong Bộ luật Tố tụng hình sự mà chỉ quy định mang tính nguyên tắc chung, nhưng về pháp lý thì tất cả các hoạt động tố tụng hình sự bao gồm cả hoạt động nghiên cứu, đánh giá chứng cứ thực chất là để chứng minh tội phạm và xử lý người phạm tội theo những tội danh được quy định cụ thể trong Bộ luật Hình sự.','LVBL',3,'302','302-1'),(9,'Phương Pháp Định Tội Danh Với 538 Tội Phạm Quy Định Trong Bộ Luật Hình Sự Năm 2015, Được Sửa Đổi, Bổ Sung Năm 2017 (Tái Bản Có Bổ Sung)','NXB Lao Động',2017,'Tiếng Việt','Trong tố tụng hình sự thì hoạt động định tội danh có vai trò rất quan trọng, nó là trọng tâm mà các hoạt động tố tụng khác hướng tới, bởi lẽ tất cả các hoạt động tố tung hình sự ở giai đoạn điều tra, truy tố, xét xử xét cho cùng đều phải đi đến kết luận về một tội phạm nào đó đã xảy ra và ai là người đã thực hiện tội phạm hay không thực hiện tội phạm đó.','LVBL',3,'302','302-1'),(10,'Spy X Family Tập 6','NXB Kim Đồng',2021,'Tiếng Việt','Nhận nhiệm vụ lấy trộm văn kiện mật về cuộc chiến, Twilight và Nightfall phải tham chiến trong đại hội ngầm dưới lòng đất!! Nhưng Nightfall, một người âm thầm ngưỡng mộ Loid và luôn cho rằng mình phù hợp với vai trò người vợ hơn ai hết, đã khiến vợ chồng nhà Forger rơi vào tình cảnh nguy hiểm…!?','TTMC',1,'101','101-1'),(11,'Spy X Family Tập 5','NXB Kim Đồng',2021,'Tiếng Việt','Chú chó có khả năng tiên đoán tương lai, Bond đã trở thành một thành viên trong gia đình. Những tưởng chiến dịch “Strix” cũng như gia đình Forger đã đi vào quỹ đạo, nhưng… Anya lại lâm vào khủng hoảng khi đối mặt với bài thi giữa kì!?','TTMC',1,'101','101-1'),(12,'Cabins','Taschen',2020,'Tiếng Anh','rong thập kỷ qua, khi sự tồn tại vật chất và dấu ấn môi trường của chúng ta đã phát triển theo cấp số nhân, các kiến ​​trúc sư trên toàn cầu đã đặc biệt quan tâm đến các khả năng của nơi ở tối thiểu, ít tác động và biệt lập. và các minh họa đương đại, tươi sáng của Marie-Laure Cruschi, khám phá cách loại kiến ​​trúc đặc biệt này tạo ra những cơ hội đặc biệt cho tư duy sáng tạo. Để tránh sự dư thừa, cabin hạn chế sự xâm nhập không gian thực tế đối với các nhu cầu thiết yếu của cuộc sống, trong khi đáp ứng với khung cảnh mộc mạc điển hình của nó, nó đưa ra các giải pháp thân thiện với môi trường.','MTKT',1,'101','101-4'),(13,'Wordsworth Editions: The Little Prince','Wordsworth Editions Ltd',1999,'Tiếng Anh','The Little Prince is a classic tale of equal appeal to children and adults. On one level it is the story of an airman\'s discovery, in the desert, of a small boy from another planet - the Little Prince of the title - and his stories of intergalactic travel, while on the other hand it is a thought-provoking allegory of the human condition. First published in 1943, the year before the author\'s death in action, this translation contains Saint-Exupery\'s delightful illustrations.','TPKD',1,'102','102-3'),(14,'Pride And Prejudice','Wordsworth Editions Ltd',1999,'Tiếng Anh','Rejection, regret and realizationa not every love story unfolds this way, but that\'s what makes Pride and Prejudice unforgettable.One of the most beloved books of all time, Pride and Prejudice - Jane Austen\'s most popular book- has been resonating with readers since it was first published in 1813 and has been adapated many times for television, movies, and books. When headstrong and independent Elizabeth Bennet, one of five sisters, is required to find a wealthy husband, her encounter with the arrogant Mr. Darcy leads to one of the most entertaining and satisfying courtships ever imagined.','TPKD',1,'102','102-3'),(15,'The Scarlet Letter','Wordsworth Editions Ltd',1999,'Tiếng Anh','Delve into a psychological romance for all time through Hawthorne\'s meditation on human alienation and its effect on the soul.In Nathaniel Hawthorne\'s dark novel, \"The Scarlet Letter,\" a single sinful act ruins the lives of three people. None more so than Hester Prynne, a young, beautiful, and dignified woman, who conceived a child out of wedlock and receives the public punishment of having to always wear a scarlet \"A\" on her clothing. She refuses to reveal the father of her child, which could lighten her sentence. Her husband, the aptly-named Roger Chillingworth, who Hester thought had died in a shipwreck but was actually being held captive by Native Americans, arrives at the exact moment of her deepest public shaming and vows to get revenge. Her lover, Arthur Dimmesdale, remains safely unidentified, but is wracked with guilt.','TPKD',1,'102','102-3'),(16,'Oxford Learner\'s Pocket Dictionary : A Pocket-sized Reference to English Vocabulary (Fourth Edition)','Oxford University Press',2008,'Tiếng Anh','The Oxford Learner\'s Pocket Dictionary has over 38,000 words, phrases, and meanings giving students a handy quick-reference guide to basic English vocabulary. It includes essential information on meanings, grammar patterns, spelling, idioms, and phrasal verbs.','TDTA',3,'301','301-1'),(17,'Me Before You (Paperback)','Penguin Random House',2017,'Tiếng Anh','From the #1 New York Times bestselling author of The Giver of Stars, discover the love story that captured over 20 million hearts in Me Before You, After You, and Still Me. ','TNT',1,'102','102-2'),(18,'Chicken Soup for the Soul: Thanks to My Mom: 101 Stories of Gratitude, Love, and Lessons','Simon & Schuster',2008,'Tiếng Anh','A mother\'s job is never done, but in Chicken Soup for the Soul: Thanks to My Mom, she gets the praise she deserves! Children of all ages share their words of thanks in these 101 stories of love, learning, and gratitude to the woman they couldn\'t have done without!','SLCLM',1,'101','101-4'),(19,'How To Win Friends And Influence People (Mass Market Paperback)','Penguin Random House',2004,'Tiếng Anh','For more than sixty years the rock-solid, time-tested advice in this book has carried thousands of now famous people up the ladder of success in their business and personal lives. Now this previously revised and updated bestseller is available in trade paperback for the first time to help you achieve your maximum potential throughout the next century!','HNKNM',3,'302','302-3'),(20,'How to be More Interesting','Penguin Random House',2004,'Tiếng Anh','Simple exercises to become the most interesting version of yourself, from the internationally bestselling and world-renowned philosopher and author, Edward de Bono.','HNKNM',3,'302','302-3'),(21,'The Happiness Curve','Bloomsbury',2008,'Tiếng Anh','This book will change your life by showing you how life changes. Why does happiness get harder in your 40s? Why do you feel in a slump even when you\'re successful? Where does this malaise come from? And, most importantly, will it ever end?','HNKNM',3,'302','302-3'),(22,'Think Like A Freak','Penguin Random House',2015,'Tiếng Anh','Now, with Think Like a Freak, Steven D. Levitt and Stephen J. Dubner have written their most revolutionary book yet. With their trademark blend of captivating storytelling and unconventional analysis, they take us inside their thought process and teach us all to think a bit more productively, more creatively, more rationally - to think, that is, like a Freak.','HNKNM',3,'302','302-3'),(23,'Từ Điển Tiếng Việt Dành Cho Học Sinh (Khổ Nhỏ)','NXB Dân Trí',2021,'Tiếng Việt','Từ điển tiếng việt (dành cho học sinh) thuộc Viện Từ điển học và Bách khoa thư Việt Nam hướng dẫn biên soạn có nội dung đầy dủ , lượng từ vựng phong phú , mang tính chính xác cao . Cách trình bày từ điển khoa học , giải thích rõ ràng .','TDTV',3,'301','301-1'),(24,'Hán Việt Tự Điển (Bìa Cứng Tái Bản Lần 1-2020)','NXB Đại Học Quốc Gia Hà Nội',2020,'Tiếng Việt','Với nội dung đa dạng, phong phú, cuốn sách này sẽ là nguồn tư liệu hữu ích để giúp bạn biết được nhiều từ vựng tiếng Trung, từ đó việc học tiếng Trung sẽ dễ dàng hơn.','TDTT',3,'301','301-1'),(25,'Thực Hành Giao Tiếp Tiếng Nhật (Sách Bỏ Túi)','NXB Tổng hợp TP.HCM',2012,'Tiếng Việt','','SHTN',3,'301','301-2'),(26,'Giao Tiếp Tiếng Anh Thật Dễ Dàng - Easy English Conversation (Tái Bản 2020)','NXB Hồng Đức',2020,'Tiếng Việt','Nội dung cuốn sách bao gồm những câu thoại tiếng Anh về những chủ đề tiếng Anh giao tiếp thông dụng nhất trong cuộc sống hàng ngày. Điều đặc biệt là những kiến thức này được trình bày dưới dạng sơ đồ tư duy giúp người học có thể dễ dàng tổng hợp kiến thức đã học và nâng cao khả năng ghi nhớ nhanh gấp 3 lần so với cách học thông thường.','SHTA',3,'301','301-2'),(27,'Mind Map Vocabulary - Học Từ Vựng Tiếng Anh Bằng Sơ Đồ Tư Duy','NXB Tổng hợp TP.HCM',2018,'Tiếng Việt','Sơ đồ tư duy (Mind Map) tuy được sử dụng rộng rãi trong nhiều lĩnh vực nhưng dùng nó như thế nào để đạt hiệu quả cao nhất không phải là điều đơn giản. Để giúp bạn có hứng thú và sự tự tin khi học tiếng Anh, chúng tôi đã dày công nghiên cứu và biên soạn quyển Học từ vựng tiếng Anh bằng sơ đồ tư duy. Khi học bằng sơ đồ tư duy, bạn sẽ dễ dàng liên tưởng đến nhiều từ khác liên quan đến từ trung tâm, từ đó nhanh chóng mở rộng vốn từ và nhớ từ lâu hơn.','SHTA',3,'301','301-2'),(28,'Try! Kỳ Thi Năng Lực Nhật Ngữ N3. Phát Triển Các Kỹ Năng Tiếng Nhật Từ Ngữ Pháp (Phiên Bản Tiếng Việt)','NXB Trẻ',2021,'Tiếng Việt','Bộ giáo trình TRY! gồm một cuốn TRY! Start cho các bạn mới bắt đầu học tiếng Nhật và 5 cuốn TRY! N1, N2, N3, N4, N5 giúp phát triển các kỹ năng tiếng Nhật thông qua việc học ngữ pháp.','SHTN',3,'301','301-2'),(29,'2000 Từ Vựng Cần Thiết Cho Kỳ Thi Năng Lực Nhật Ngữ N3','NXB Trẻ',2020,'Tiếng Việt','Bộ sách học từ vựng cấp độ N5 ~ N1 dành cho Kỳ thi Năng lực Nhật ngữ. Bộ sách gồm 5 cuốn: N1, N2, N3, N4, N5, tập hợp các từ vựng xuất hiện thường xuyên trong các kỳ thi Năng lực Nhật ngữ. Các từ vựng này được chia theo từng chủ đề, đi kèm các câu ví dụ. Đặc biệt bộ sách có kèm theo bản dịch Anh - Trung - Việt, rất tiện cho các bạn tự học ở nhà.','SHTN',3,'301','301-2'),(30,'2500 Từ Vựng Cần Thiết Cho Kỳ Thi Năng Lực Nhật Ngữ N2','NXB Trẻ',2020,'Tiếng Việt','Bộ sách học từ vựng cấp độ N5 ~ N1 dành cho Kỳ thi Năng lực Nhật ngữ. Bộ sách gồm 5 cuốn: N1, N2, N3, N4, N5, tập hợp các từ vựng xuất hiện thường xuyên trong các kỳ thi Năng lực Nhật ngữ. Các từ vựng này được chia theo từng chủ đề, đi kèm các câu ví dụ. Đặc biệt bộ sách có kèm theo bản dịch Anh - Trung - Việt, rất tiện cho các bạn tự học ở nhà.','SHTN',3,'301','301-2'),(31,'Cuốn theo chiều gió (Bìa cứng)','NXB Văn Học',2021,'Tiếng Việt','','TPKD',1,'102','102-3'),(32,'Nghìn lẻ một đêm','NXB Văn Học',2021,'Tiếng Việt','','TPKD',1,'102','102-3'),(33,'Truyện cổ Grimm','NXB Văn Học',2021,'Tiếng Việt','','TCT',1,'101','101-1'),(34,'Khát Vọng Sống (Bìa Cứng)','NXB Văn Học',2020,'Tiếng Việt','','TDKNS',3,'302','302-3'),(35,'Dế Mèn Phiêu Lưu Kí','NXB Kim Đồng',2021,'Tiếng Việt','','VHTN',1,'101','101-1'),(36,'Muôn kiếp nhân sinh (Bìa cứng)','NXB Tổng hợp TP.HCM',2020,'Tiếng Việt','','TGTL',1,'101','101-2'),(37,'Đừng Bao Giờ Đi Ăn Một Mình (Tái Bản)','NXB Trẻ',2017,'Tiếng Việt','','BHKD',3,'301','301-3'),(38,'Kinh Doanh - Khái Lược Những Tư Tưởng Lớn','NXB Dân Trí',2019,'Tiếng Việt','','BHKD',3,'301','301-3'),(39,'Số Đỏ (Tái Bản)','NXB Văn Học',2021,'Tiếng Việt','','TPKD',1,'102'