ương trình tuyến tính Chương 3. Đường cong khớp Chương 4. Giải phương trình phi tuyến Chương 5. Tính gần đúng đạo hàm và phân tích Chương 6. Bài toán giá trị ban đầu đối với phương trình vi phân thường Chương 7. Các phương pháp cực tiểu hóa không ràng buộc Chương 8. Quy hoạch tuyến tính','CNTTTT',2,'202','202-2'),(67,'Đánh giá hiệu năng mạng','NXB Bách Khoa Hà Nội',2012,'Tiếng Việt','Sách được bố cục thành sáu chương, trong đó hai chương đầu đề cập đến các khái niệm cơ bản nhất của đánh giá hiệu năng mạng và các kiến thức cơ bản về xác suất thống kê và các tiến trình ngẫu nhiên.Hai chương tiếp theo trình bày các khái niệm về hàng đợi và mạng hàng đợi, cách sử dụng chúng để đánh giá hiệu năng của các hệ thống trong thực tế.Hai chương cuối cùng trình bày các khái niệm về chất lượng dịch vụ và các kỹ thuật mô phỏng cùng với các công cụ được sử dụng rộng rãi hiện nay.','CNTTTT',2,'202','202-2'),(68,'Điện toán đám mây','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Giáo trình cung cấp cho bạn đọc cái nhìn tổng thể về các khái niệm cơ bản về điện toán đám mây, các vấn đề về lưu trữ và xử lý dữ liệu, các vấn đề về an toàn và bảo mật, các dịch vụ, kiến trúc dịch vụ, hệ giám sát, một số chủ đề nâng cao gợi mở các vấn đề nghiên cứu hiện nay trong lĩnh vực điện toán đám mây.','CNTTTT',2,'202','202-2'),(69,'CHÍNH XÁC - Nguyên lý, Thực thi và giải pháp cho Internet Vạn vật','NXB Bách Khoa Hà Nội',2008,'Tiếng Việt','Cuốn sách này là một hướng dẫn thực tế về quy trình hoàn chỉnh cho doanh nghiệp và các chuyên gia công nghệ.','CNTTTT',2,'202','202-2'),(70,'Giáo trình Cơ sở an toàn thông tin','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','','CNTTTT',2,'202','202-2'),(71,'Hệ trợ giúp quyết định','NXB Bách Khoa Hà Nội',2019,'Tiếng Việt','','CNTTTT',2,'202','202-2'),(72,'Thiết kế mạng Intranet','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Cuốn sách này được biên soạn làm tài liệu học tập và tham khảo cho sinh viên các chuyên ngành về Mạng máy tính và Truyền thông. Nội dung cuốn sách đề cập đến các vấn đề lý thuyết cơ bản của mạng máy tính và các công nghệ mạng tiến tiến hiện nay như IPv6, Mobility,... Với mục tiêu là giáo trình môn học, sau mỗi chương lý thuyết, các bài thực hành được trình bày ở mức độ đủ chi tiết để sinh viên có thể tự triển khai thực hiện. Xen kẽ trong các bài thực hành, các vấn đề lý thuyết cũng được phân tích và đối chiếu, giúp sinh viên hiểu rõ hơn các khái niệm trừu tượng và phức tạp.','CNTTTT',2,'202','202-2'),(73,'Kỹ thuật Radar và định vị bằng vệ tinh','NXB Bách Khoa Hà Nội',2005,'Tiếng Việt','Giáo trình cung cấp kiến thức nền tảng về lý thuyết phân tích và thiết kế hệ thống Radar cho sinh viên ngành điện tử viễn thông.','DTVT',2,'202','202-4'),(74,'Nền tảng cung cấp dịch vụ cho các mạng thế hệ mới','NXB Bách Khoa Hà Nội',2007,'Tiếng Việt','Cuốn sách tập hợp các kiến thức về mặt lý thuyết cũng như kết quả thực nghiệm thu thập được qua quá trình thực hiện các đề tài nghiên cứu và phát triển các công nghệ nền tảng và công nghệ lõi cung cấp dịch vụ cho các mạng thế hệ mới.','DTVT',2,'202','202-4'),(75,'Phân tích và điều khiển hệ phi tuyến','NXB Bách Khoa Hà Nội',2004,'Tiếng Việt','Sách được bố cục thành bốn chương, trình bày những nội dung nền tảng cơ bản và cả những kết quả mở rộng, nâng cao mới được công bố trong những năm gần đây.','DTVT',2,'202','202-4'),(76,'Solid-state electronic devices','NXB Bách Khoa Hà Nội',2013,'Tiếng Việt','Cuốn sách trình bày những kiến thức cơ bản về trạng thái rắn của các thiết bị điện tử. Sách dùng cho sinh viên ngành vật lý, điện thử viễn thông, đồng thời cũng có thể làm sách tham khảo cho các kỹ sư làm việc trong lĩnh vực này.','DTVT',2,'202','202-4'),(77,'Trường điện từ - Kiến thức căn bản và bài tập','NXB Bách Khoa Hà Nội',2006,'Tiếng Việt','Cuốn sách gồm 5 chương, với ba nội dung chính: 1. Giới thiệu trường điện từ, bao gồm trường tĩnh và trường điện từ biến thiên 2. Phương pháp khảo sát, đặc điểm lan truyền của sóng điện từ trong không gian và trong đường truyền định hướng. 3. Phương pháp khảo sát bức xạ điện từ. Đặc điểm trường bức xạ của các nguồn bức xạ đơn giản.','DTVT',2,'202','202-4'),(78,'Bộ điều khiển logic khả trình PLC và ứng dụng','NXB Bách Khoa Hà Nội',2009,'Tiếng Việt','Nội dung của cuốn sách trình bày các kiến thức cơ bản và chung nhất về PLC với quan điểm hệ thống hóa và tính ứng dụng. Hy vọng người đọc có thể sử dụng cho các chủng loại PLC được lựa chọn.','DTVT',2,'202','202-4'),(79,'Giáo trình hệ thống viễn thông','NXB Bách Khoa Hà Nội',2008,'Tiếng Việt','Nội dung giáo trình trình bày từ các khái niệm cơ bản đến các hệ thống, kỹ thuật hiện đại ứng dụng trong thực tế, kèm theo là các ví dụ minh họa rất cụ thể.','DTVT',2,'202','202-4'),(80,'Kỹ thuật đo lường tự động điều khiển','NXB Bách Khoa Hà Nội',2008,'Tiếng Việt','Cuốn sách không những cung cấp cơ sở lý thuyết mà còn đưa ra những ứng dụng thực tiễn nhằm giúp cho bạn đọc có thể hiểu rõ về các hệ thống thiết bị đo lường tự động điều khiển trên thực tế để từ đó có khả năng tự thiết kế chế tạo cho mình những hệ thống thiết bị đo lường tự động điều khiển.','DTVT',2,'202','202-4'),(81,'Mạch xử lý tín hiệu y sinh','NXB Bách Khoa Hà Nội',2011,'Tiếng Việt',' Đây là sách giáo trình nhằm phục vụ cho công tác đào tạo sinh viên ngành Kỹ thuật Y sinh nói chung và chuyên ngành. Điện tử Y sinh nói riêng trên cả nước. Nội dung của giáo trình được biên soạn dựa trên đề cương chi tiết môn học “Mạch xử lý tín hiệu Y sinh” đã được Bộ Giáo dục và Đào tạo phê duyệt theo chương trình khung Quốc gia ngành đào tạo Kỹ thuật Y sinh. ','DTVT',2,'202','202-4'),(82,'Tối ưu hóa trong điều khiển và điều khiển tối ưu','NXB Bách Khoa Hà Nội',2012,'Tiếng Việt','Nội dung sách là những kiến thức lý thuyết rất cơ bản của Tối ưu hóa và Điều khiển tối ưu, một số kết quả nghiên cứu riêng của tác giả cũng như các ứng dụng điển hình của chúng vào điều khiển hiện đại, như điều khiển thích nghi, bền vững, điều khiển dự báo, nhận dạng hệ thống, quan sát trạng thái¼','DTVT',2,'202','202-4'),(83,'Điều khiển với Simatic S7-300','NXB Bách Khoa Hà Nội',2010,'Tiếng Việt','Cuốn sách này cung cấp những kiến thức bổ ích về điều khiển, tự động hóa... cho sinh viên, học viên cao học, nghiên cứu sinh cũng như những cán bộ làm việc trong ngành Điều khiển Tự động, Tự động hóa, Đo lường, Tin học công nghiệp và các ngành kỹ thuật khác','DTVT',2,'202','202-4'),(84,'Cơ sở hệ thống điều khiển quá trình','NXB Bách Khoa Hà Nội',2001,'Tiếng Việt','Nội dung chính của cuốn sách cũng có thể sử dụng làm tài liệu học tập cho sinh viên các ngành liên quan (Nhiệt, Hóa, Sinh học thực phẩm, Môi trường…)','D',2,'202','202-2'),(85,'Hệ thống điều khiển giám sát và thu thập dữ liệu SCADA','NXB Bách Khoa Hà Nội',2006,'Tiếng Việt','Cuốn sách nhằm trang bị cho sinh viên và các kỹ sư vận hành hệ thống điện những kiến thức cơ bản về hệ thống SCADA và phạm vi ứng dụng của chúng trong điều độ hệ thống điện, trong nhà máy điện và lưới điện hạ thế.','D',2,'202','202-2'),(86,'Mạng nơ-rôn và ứng dụng trong xử lý tín hiệu','NXB Bách Khoa Hà Nội',2007,'Tiếng Việt','Cuốn sách bao gồm 8 chương, trình bày một số kiến thức cơ bản về một chuyên ngành tương đối mới của ngành Trí tuệ nhân tạo là các mạng nơ rôn nhân tạo và một số khả năng ứng dụng thực tế của các công cụ mạng nơ rôn nhân tạo trong các bài toán xử lý tín hiệu thực tế.','D',2,'202','202-2'),(87,'Phân tích chế độ xác lập hệ thống điện','NXB Bách Khoa Hà Nội',2002,'Tiếng Việt','Việc tính toán thiết kế, phân tích các chế độ xác lập đối với các nhà máy điện lớn, các hệ thống điện phức tạp đòi hỏi có các phương pháp tính toán hiện đại, đặc biệt là lập trình tính toán bằng máy tính, sử dụng các kỹ thuật điện tử công suất trong điều khiển nâng cao chất lượng điện cho hệ thống truyền tải điện. Giáo trình “Phân tích chế độ xác lập hệ thống điện” cung cấp các kiến thức cơ bản về các vấn đề trên.','D',2,'202','202-2'),(88,'Hệ thống truyền tải điện xoay chiều linh hoạt','NXB Bách Khoa Hà Nội',2003,'Tiếng Việt','','D',2,'202','202-2'),(89,'Mạng nơ-rôn và ứng dụng trong xử lý tín hiệu (xuất bản lần 2)','NXB Bách Khoa Hà Nội',2008,'Tiếng Việt','Với cuốn sách, người đọc có thể tìm hiểu và nắm được các ý tưởng chính về mạng nơ–rôn nhân tạo, từ đó triển khai ứng dụng các công cụ này trong các bài toán xử lý tín hiệu phức tạp khi mà các công cụ kinh điển tỏ ra không hiệu quả. Cuốn sách bao gồm 8 chương, trình bày một số kiến thức cơ bản về một chuyên ngành tương đối mới của ngành Trí tuệ nhân tạo là các mạng nơ–rôn nhân tạo và một số khả năng ứng dụng thực tế của các công cụ mạng nơ–rôn nhân tạo trong các bài toán xử lý tín hiệu thực tế','D',2,'202','202-2'),(90,'Hướng dẫn học môn Pháp luật đại cương','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Giáo trình giới thiệu các kiến thức cơ bản về pháp luật, bao gồm các nội dung sau: Chương 1. Nhập môn Pháp luật đại cương Chương 2. Khái quát về nhà nước trong mối quan hệ với pháp luật Chương 3. Nhà nước cộng hòa xã hội chủ nghĩa Việt Nam Chương 4. Những vấn đề cơ bản về pháp luật Chương 5. Các hệ thống pháp luật chủ yếu trên thế giới Chương 6. Hệ thống pháp luật nước CHXHCN Việt Nam Chương 7. Lĩnh vực pháp luật Sở hữu trí tuệ và lĩnh vực pháp luật về khoa học công nghệ ở Việt Nam','KTQL',2,'202','202-6'),(91,'Kết cấu ô tô','NXB Bách Khoa Hà Nội',2016,'Tiếng Việt','Kết cấu ô tô là cuốn sách trình bày về cấu tạo, nguyên lý làm việc của các hệ thống, cụm, bộ phận, chi tiết của ô tô con, ô tô chở người, ô tô tải, ô tô chuyên dụng. Các kết cấu đề cập trong sách được định hướng theo tính cơ bản và hiện đại.','CKDL',2,'202','202-1'),(92,'Phương pháp phân tích phổ phân tử','NXB Bách Khoa Hà Nội',2014,'Tiếng Việt','Các phương pháp phân tích quang phổ, như phương pháp phổ phát xạ và hấp thụ nguyên tử, phổ hấp thụ phân tử, phổ huỳnh quang, phổ hồng ngoại và phổ khối lượng,... là những kỹ thuật phân tích hóa lý hiện đại đã và đang được phát triển và ứng dụng rất rộng rãi trên toàn thế giới trong nhiều ngành khoa học kỹ thuật, vật lý, hóa học, trong sản xuất công nghiệp, nông nghiệp, y dược, địa chất, môi trường,...','KTHH',2,'202','202-5'),(93,'Điều khiển học lặp','NXB Bách Khoa Hà Nội',2021,'Tiếng Việt','Cuốn sách được biên soạn làm giáo trình học tập môn học Điều khiển thông minh cho các bạn sinh viên ngành Kỹ thuật điều khiển và Tự động hóa, Trường Đại học Bách khoa Hà Nội; đồng thời cũng là một tài liệu bổ trợ cho việc hiểu kỹ, hiểu sâu bài giảng về Điều khiển thông minh, cũng như hỗ trợ việc tự học của sinh viên, học viên cao học, nghiên cứu sinh thuộc các ngành liên quan trong các trường đại học kỹ thuật khác.','KTDKTDH',2,'202','202-5'),(94,'Cơ sở lý thuyết của các phương pháp phân tích điện hóa','NXB Bách Khoa Hà Nội',2014,'Tiếng Việt','Cơ sở lý thuyết đầy đủ viết bằng tiếng Việt về các kỹ thuật phân tích điện hóa, để phục vụ đào tạo, hay giúp các cán bộ của chúng ta học tập và nâng cao tay nghề.','KTHH',2,'202','202-5'),(95,'Công nghệ và kỹ thuật vật liệu cao su - Quyển 1: Công nghệ cao su','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Quyển 1 – Công nghệ cao su – trình bày các kiến thức về nguyên tắc thành lập đơn phối liệu cao su, các nguyên liệu chính cho vật liệu cao su, các quá trình gia công cao su cơ bản và công nghệ latex.','KTHH',2,'202','202-5'),(96,'Thống kê công nghiệp hiện đại với ứng dụng viết trên R, Minitab và JMP','NXB Bách Khoa Hà Nội',2020,'Tiếng Việt','Thông qua cuốn sách này, bạn đọc sẽ nhận ra sự cần thiết phải cải tiến liên tục các quá trình công nghiệp để đạt được chất lượng, độ tin cậy, năng suất và lợi nhuận cao. Hơn nữa độc giả cũng sẽ thấy rằng chỉ bản thân các kỹ thuật quản lý, chẳng hạn như quản lý chất lượng tổng thể, hoặc tái cấu trúc quá trình kinh doanh là không đủ để đạt được mục tiêu nói trên, mà còn phải cần đến việc áp dụng mạnh mẽ thủ tục thống kê được thiết kế đặc biệt.','TTUD',2,'202','202-6'),(97,'Công nghệ gia công áp lực','NXB Bách Khoa Hà Nội',2014,'Tiếng Việt','Cuốn sách cung cấp cho người đọc những kiến thức đại cương về máy và công nghệ gia công áp lực trong việc chế tạo các chi tiết máy, sản phẩm cơ khí, giúp người đọc nắm bắt được các loại hình công nghệ dập tấm, dập khối, dập đặc biệt, hiểu được trình tự xây dựng quy trình công nghệ và thiết kế khuôn.','CK',2,'202','202-1'),(98,'Phân tích chế độ xác lập đường dây tải điện','NXB Bách Khoa Hà Nội',2016,'Tiếng Việt','Cuốn sách trình bày những kiến thức về đặc điểm làm việc cũng như phương pháp tính toán phân tích sự làm việc của đường dây tải điện cao áp (dòng điện xoay chiều) và lưới điện cao áp trong chế độ xác lập. Đây là một nội dung cơ bản thuộc môn học Lưới Điện (hay Phân tích Hệ thống Điện) dành cho cử nhân và kĩ sư chuyên ngành Hệ thống Điện lực.','D',2,'202','202-2'),(99,'Điều khiển tự động các quá trình công nghệ sinh học - thực phẩm','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Cuốn sách này không chỉ đáp ứng được các nhu cầu trên mà còn cung cấp các kiến thức về các hệ thống điều khiển hiện đại nhằm hiện thực hóa các hệ thống điều khiển quá trình công nghệ trong công nghiệp sản xuất các chế phẩm sinh học và công nghệ chế biến thực phẩm. Đây cũng là tài liệu tham khảo bổ ích cho các học viên cao học, các kỹ sư cũng như kỹ thuật viên làm việc trong các lĩnh vực liên quan trong nhà máy hóa chất – lọc dầu, lĩnh vực môi trường...','CNSH',2,'202','202-1'),(100,'Bài tập trắc nghiệm kỹ thuật nhiệt','NXB Bách Khoa Hà Nội',2021,'Tiếng Việt','Cuốn sách trình bày các kiến thức cơ bản nhất sinh viên cần biết và vận dụng khi tính toán cùng với các bảng biểu kèm theo, đó cũng chính là tuyển tập đề thi trắc nghiệm cho sinh viên các khóa trước tại Đại học Bách khoa Hà Nội.','KTN',2,'202','202-5'),(101,'Kỹ thuật truyền nhiệt - Mô hình và thiết kế','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Cuốn sách này được thực hiện nhằm mục đích cập nhật các phương pháp kĩ thuật ứng dụng nhằm giải quyết các bài toán về truyền nhiệt trong thiết kế thiết bị và mô hình hóa các quá trình. Trọng tâm của cuốn sách được tập trung vào nhiệm vụ thiết kế các thiết bị truyền nhiệt cũng như phân tích và đánh giá hiệu quả của các quá trình và thiết bị truyền nhiệt. Bên cạnh đó, các nguyên lí cơ bản của các phương pháp thiết kế cũng được đặc biệt chú ý.','KTN',2,'202','202-5'),(102,'Thí nghiệm Hóa Lý','NXB Bách Khoa Hà Nội',2020,'Tiếng Việt','Nội dung cuốn Thí nghiệm Hóa lý này được biên soạn trên cơ sở cuốn Thí nghiệm Hóa lý xuất bản năm 1993 với sự đóng góp quan trọng của các thế hệ thầy cô kỳ cựu đã từng công tác tại Bộ môn Hóa lý. Cuốn sách được bổ sung các bài thí nghiệm mới, các bài thí nghiệm cũ được chỉnh sửa cập nhật bổ sung. Các bài thí nghiệm mới có sự đóng góp của các thầy cô hiện đã và đang công tác tại Bộ môn Hóa lý, Viện Kỹ thuật Hóa học, Trường Đại học Bách khoa Hà Nội.','KTHH',2,'202','202-5'),(103,'Công nghệ sản xuất vắc xin (xuất bản lần 2)','NXB Bách Khoa Hà Nội',2019,'Tiếng Việt','Cuốn sách được biên soạn làm tài liệu giảng dạy cho đối tượng kỹ sư công nghệ sinh học trong trường các đại học và có thể làm tài liệu tham khảo cho các đối tượng liên quan. Sách cung cấp cho sinh viên và người đọc những kiến thức cơ bản về vắc xin, các nguyên tắc phát triển một vắc xin, một số kỹ thuật sử dụng trong sản xuất, thực hành sản xuất tốt cho sản xuất và kiểm tra chất lượng vắc xin.','CNSH',2,'202','202-1'),(104,'Sổ tay sử dụng thuốc nhuộm (Tập 1 – Thuốc nhuộm châu Á)','NXB Bách Khoa Hà Nội',2020,'Tiếng Việt','Cuốn sách này được biên soạn nhằm mục đích cung cấp cho bạn đọc, trước hết là các cán bộ kỹ thuật nhuộm – in hoa những thông tin cơ bản, tương đối đầy đủ, chính xác và mới nhất về các loại thuốc nhuộm châu Á (Trung Quốc, Hàn Quốc, Thái Lan) chủ yếu, có chất lượng và đáp ứng các yêu cầu môi trường và sức khoẻ người sử dụng.','KTHH',2,'202','202-5'),(105,'Bơm, quạt cánh dẫn','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Sách có thể dùng làm tài liệu học tập và tham khảo cho sinh viên các ngành Cơ khí, Xây dựng, Máy Năng lượng và một số ngành khác, đồng thời cũng là tài liệu tham khảo bổ ích cho các cán bộ kỹ thuật làm những công việc liên quan tới các máy bơm, quạt là các thiết bị được ứng dụng rất rộng rãi trong các ngành kinh tế quốc dân.','CK',2,'202','202-1'),(106,'Pin Mặt trời Nguyên lý và ứng dụng','NXB Bách Khoa Hà Nội',2016,'Tiếng Việt','Cuốn sách được biên soạn trên cơ sở kế thừa, bổ sung và cập nhật các tài liệu giảng dạy của các tác giả trong nhiều năm qua, nhằm góp phần phổ biến và nâng cao kiến thức về công nghệ điện mặt trời cho bạn đọc.','D',2,'202','202-2'),(107,'Mạ kẽm lý thuyết và ứng dụng','NXB Bách Khoa Hà Nội',2015,'Tiếng Việt','Sách cung cấp cho bạn đọc những hiểu biết toàn diện và phong phú nhưng rất cô đọng về cơ sở lý thuyết của quá trình công nghệ mạ kẽm từ truyền thống đến hiện đại. Đồng thời sách cũng rất chú trọng đến việc giới thiệu những ứng dụng công nghệ và kỹ thuật mới trong mạ kẽm hiện nay.','CK',2,'202','202-1'),(108,'Dệt nhuộm với môi trường - Tập 1','NXB Bách Khoa Hà Nội',2014,'Tiếng Việt','Tập 1 gồm những vấn đề sinh thái và môi trường trong chuẩn bị dệt, cụ thể là hồ sợi dọc, rồi đến xử lý trước (còn hay gọi là tiền xử lý) bao gồm cả tẩy trắng. Những công nghệ xử lý trước tiên tiến và thân thiện với môi trường được giới thiệu gắn liền. Tiếp theo là những vấn đề sinh thái và môi trường trong nhuộm cùng những công nghệ nhuộm mới và thân thiện với môi trường.','DM',2,'202','202-4'),(109,'Giáo trình Kỹ thuật, công nghệ cơ khí cơ bản','NXB Bách Khoa Hà Nội',2021,'Tiếng Việt','Giáo trình được biên soạn trên cơ sở kế thừa, phát triển từ Giáo trình Cơ khí Đại cương xuất bản năm 2011 (NXB Giáo dục Việt Nam), sử dụng làm giáo trình giảng dạy cho sinh viên ngành Cơ khí và các ngành kỹ thuật, công nghệ liên quan tại các trường đại học kỹ thu','CK',2,'202','202-1'),(110,'Điều khiển vector truyền động xoay chiều ba pha','NXB Bách Khoa Hà Nội',2019,'Tiếng Việt','Cuốn sách được biên soạn trên nền tảng cuốn sách tiếng Anh “Vector Control of Three-Phase AC Machines – System Development in the Practice” của cùng tác giả được NXB Springer phát hành toàn cầu năm 2008. Nội dung sách cập nhật những kiến thức mới nhất của điều khiển truyền động điện xoay chiều ba pha.','D',2,'202','202-2'),(111,'Cơ sở lý thuyết điều khiển tuyến tính','NXB Bách Khoa Hà Nội',2020,'Tiếng Việt','Cuốn sách này được viết ra từ các bài giảng trong nhiều năm của tác giả tại trường Đại học Bách khoa Hà Nội về Lý thuyết điều khiển tự động I và II. Cuốn sách được trình bày theo chủ đề từng dạng mô hình mô tả hệ thống được sử dụng','D',2,'202','202-2'),(112,'Vật lý bán dẫn (Tập 2: Những vấn đề và bài tập ứng dụng)','NXB Bách Khoa Hà Nội',2016,'Tiếng Việt','Tập II bao gồm 203 bài tập về cơ sở vật lý, vật liệu và linh kiện bán dẫn. Các bài tập có bài giải kèm theo và được sắp xếp thành các chương về cơ bản theo thứ tự nội dung của tập I.','VLKT',2,'202','202-6'),(113,'Giáo trình Bảo hiểm (Tái bản 2021)','NXB Bách Khoa Hà Nội',2021,'Tiếng Việt','Giáo trình trang bị cho sinh viên kiến thức cơ sở về bảo hiểm và tổ chức hoạt động kinh doanh bảo hiểm, nguyên tắc bảo hiểm, pháp luật hiện hành quy định về bảo hiểm và vận dụng các nghiệp vụ bảo hiểm cơ bản. Trên cơ sở đó, người đọc có khả năng giải quyết các bài toán liên quan đến tính phí bảo hiểm, xác định tổn thất và giá trị bồi thường của doanh nghiệp bảo hiểm cũng như có khả năng lập luận tư duy theo hệ thống, giải quyết các vấn đề, khám phá và đề xuất được các giải pháp trong lĩnh vực bảo hiểm.','TC',2,'202','202-6'),(114,'Tín hiệu và hệ thống','NXB Bách Khoa Hà Nội',2021,'Tiếng Việt','Cuốn sách này dự kiến là giáo trình cho các môn học về tín hiệu và hệ thống dành cho sinh viên những năm đầu thuộc ngành Kỹ thuật điều khiển và Tự động hóa. Tuy nhiên, cuốn sách cũng có thể được sử dụng để dạy những sinh viên ngành Điện tử viễn thông, Kỹ thuật y sinh và Kỹ thuật cơ khí. Nó cũng có thể hữu ích cho các kỹ sư thực hành yêu thích việc tự học và ôn lại những kiến thức cơ bản của tín hiệu và hệ thống.','KTDKTDH',2,'202','202-5'),(115,'Hệ thống truyền tải điện xoay chiều linh hoạt (Tái bản 2021)','NXB Bách Khoa Hà Nội',2021,'Tiếng Việt','Cuốn sách được biên soạn làm tài liệu học tập và tham khảo cho sinh viên chuyên ngành Kỹ thuật điện trong các môn học: Hệ thống truyền tải điện xoay chiều linh hoạt FACTS, Tối ưu hoá chế độ hệ thống điện, Phân tích và điều khiển ổn định hệ thống điện và Mô phỏng hệ thống điện','D',2,'202','202-2'),(116,'Cơ sở đo lường và lý thuyết điều khiển tự động quá trình công nghệ (Fundamental of Process Measurement & Control Theory)','NXB Bách Khoa Hà Nội',2019,'Tiếng Việt','Cuốn sách này được trình bày với hai nội dung chính: kỹ thuật điều khiển tự động và kỹ thuật đo lường các thông số công nghệ được kỳ vọng sẽ tạo dựng những kiến thức cơ bản cho sinh viên, cao học viên cũng như các đối tượng bạn đọc khác nhau bước đầu tiếp cận việc tự động hóa quá trình công nghệ sinh học – thực phẩm.','KTDKTDH',2,'202','202-5'),(117,'Mô phỏng các quá trình cơ bản trong công nghệ hóa học  (xuất bản lần 2)','NXB Bách Khoa Hà Nội',2020,'Tiếng Việt','Cuốn sách này cung cấp những kiến thức cơ bản cho sinh viên lần đầu tiên sử dụng phần mềm mô phỏng UNISIM và có ít hoặc chưa có kinh nghiệm mô phỏng trên máy tính. Sách là giáo trình dành cho sinh viên các trường đại học công nghệ, đồng thời có thể sử dụng như một chỉ dẫn cho các khóa học cao hơn trong công nghệ hóa học. Ngoài ra, cuốn sách còn có thể sử dụng đồng thời cho cả sinh viên và kỹ sư thực hành, như một tài liệu hướng dẫn hay một cuốn sổ tay cho các khóa học UNISIM.','KTHH',2,'202','202-5'),(118,'Công nghệ đóng tàu','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Cuốn sách là tài liệu học tập chính cho sinh viên, phục vụ công tác giảng dạy, cũng đồng thời là tài liệu tham khảo cho học viên chuyên ngành Kỹ thuật tàu thủy nói chung. Sách cung cấp bao quát từ những khái niệm, thông tin tổng quan về lĩnh vực công nghệ đóng tàu trong nước và trên thế giới đến những quy trình công nghệ, kỹ thuật cụ thể chuyên sâu về công nghệ đóng tàu. Sách cũng đồng thời cung cấp cho người đọc những kiến thức chuyên môn từ cơ sở khái niệm đến chi tiết chuyên sâu về công nghệ đóng tàu, để người đọc có thể nắm bắt được toàn bộ quá trình công nghệ đóng tàu tổng thể đến thiết kế công nghệ đóng mới cho toàn tàu, thiết kế chế tạo chi tiết và hạ thủy thử nghiệm tàu.','CK',2,'202','202-1'),(119,'Thiết bị tiết lưu và thiết bị phụ','NXB Bách Khoa Hà Nội',2017,'Tiếng Việt','Cuốn sách này đi sâu giới thiệu và phân tích sự vận hành của toàn bộ các loại thiết bị tiết lưu đã được phát triển và ứng dụng trong kỹ thuật lạnh và điều hòa không khí, đặc biệt là các loại van tiết lưu điện tử.','KTN',2,'202','202-5'),(120,'Công nghệ in hoa sản phẩm dệt may','NXB Bách Khoa Hà Nội',2019,'Tiếng Việt','Cuốn sách này được biên soạn nhằm trang bị những kiến thức cơ bản về công nghệ in cho sinh viên ngành Dệt may và những người làm nghề in, đồng thời cung cấp thêm cho bạn đọc những tư liệu về ngành in để học tập, nghiên cứu, tham khảo.','DM',2,'202','202-4'),(121,'Ổn định của hệ động lực và các áp dụng kỹ thuật','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Nội dung cuốn sách là khảo sát ổn định của quá trình động lực: đưa ra các định nghĩa về ổn định, các tiêu chuẩn về ổn định và không ổn định, các phương pháp nghiên cứu ổn định và khảo sát các bài toán mang tính minh họa và định hướng áp dụng.','CK',2,'202','202-1'),(122,'Dệt nhuộm với môi trường - Tập 2','NXB Bách Khoa Hà Nội',2015,'Tiếng Việt','Tập 2 bao gồm những khía cạnh sinh thái và môi trường trong in hoa và xử lý cuối cùng hàng dệt. Ngoài ra còn một nội dung quan trọng khác là sinh thái sử dụng hàng dệt và nhãn sinh thái hàng dệt.','DM',2,'202','202-4'),(123,'Kỹ thuật tách hỗn hợp nhiều cấu tử - Tập 2 - Tính toán và thiết kế','NXB Bách Khoa Hà Nội',2017,'Tiếng Việt','Tập 2 “Tính toán và Thiết kế” trình bày các phương pháp mới nhất, có độ tin cậy cao nhất (ở thời điểm hiện tại) dùng để tính toán và thiết kế các hệ thống thiết bị tách hỗn hợp nhiều cấu tử. Đây là những kiến thức rất cần thiết và hữu ích trong tính toán, thiết kế và vận hành các quá trình và thiết bị tách các hỗn hợp nhiều cấu tử (ví dụ: các quá trình và thiết bị lọc dầu, các hệ thống tách hỗn hợp khí đã hóa lỏng…).','KTHH',2,'202','202-5'),(124,'Hệ thống cung cấp nhiệt','NXB Bách Khoa Hà Nội',2018,'Tiếng Việt','Cuốn sách này ra đời nhằm cung cấp cho sinh viên những kiến thức cơ bản để có thể khảo sát, thiết kế, xây dựng và vận hành hệ thống cung cấp nhiệt một cách an toàn và kinh tế.','KTN',2,'202','202-5'),(125,'Sách - Chiêm Tinh Học Ứng Dụng Trong Sự Nghiệp Và Tình Yêu','NXB Hồng Đức',2021,'Tiếng Việt','Chiêm tinh học là các hệ thống bói toán khoa học dựa trên các tiền đề của một mối quan hệ giữa các hiện tượng thiên văn và các sự kiện trong thế giới nhân loại. Cuốn sách Chiêm Tinh Học Ứng Dụng Trong Sự Nghiệp Và Tình Yêu mang đến cho bạn những hiểu biết chuyên sâu về chủ đề này vừa giúp bạn vận dụng trong những lĩnh vực cụ thể hàng ngày.','SCTH',3,'302','302-2'),(126,'Chiêm Tinh Học: Giải Mã Các Mối Quan Hệ','NXB Thế Giới',2021,'Tiếng Việt','Cái hay của Chiêm tinh học: Giải mã mối quan hệ là mang đến cho bạn cơ hội để bước khỏi góc độ vốn dĩ của bản thân để quan sát cuộc đời và ngắm nhìn thế giới qua đôi mắt của người thương mến. Bởi mỗi hình tinh, tính cả Mặt Trời lẫn Mặt Trăng, lại đại diện cho những trung tâm nhận thức khác nhau trong bạn. Những trung tâm này vốn sẵn tồn tại. Chiêm tinh học không tạo ra, nhào nặn, hay là nguyên nhân khiến những trung tâm ý thức này xuất hiện, nhưng chiêm tinh học đại diện cho chúng, thể hiện chúng. Các hành tinh cung cấp một bản đồ tham chiếu cho những trải nghiệm bạn đã và đang nếm trải và chiêm tinh học chỉ ra lối đi để có được sự hòa hợp. Bạn có thể hình dung những mô tả chiêm tinh học như các tấm biển chỉ đường, nhưng cho đến giờ phút này, lời chỉ dẫn bạn cần quan tâm nhất vẫn là lời chỉ dẫn về chính bạn.','SCTH',3,'302','302-2'),(127,'Tiểu Vũ Trụ - Tô Màu Thế Giới 12 Chòm Sao','NXB Thế Giới',2021,'Tiếng Việt','Mỗi người được sinh ra với một hình hài, một tính cách sơ khai ban đầu được che chở bởi một chòm sao chiếu mệnh. Quá trình lớn lên, những người ta gặp được, những trải nghiệm vui buồn, những xúc cảm tình yê đã hình thành nên muôn vàn tính cách khác nhau, số phận riêng biệt, tạo thành một tiểu vũ trụ của mỗi người.','SCTH',3,'302','302-2'),(128,'Trên Hành Trình Tự Học','NXB Hội Nhà Văn',2021,'Tiếng Việt','Sách chia làm bốn phần chính: Học Để Biết, Học Để Làm, Học Để Chuyển Mình, Học Để Chung Sống. Mỗi phần đều được viết dựa trên kinh nghiệm của tác giả và từ những câu chuyện của những người bạn mà tác giả có dịp gặp gỡ, chia sẻ. Tác giả cũng xem xét về các khía cạnh khác nhau của sự học: cách học trực tuyến, học từ trường, từ gia đình… Song song đó là nhận định tổng quan về giá trị chung của việc học.','PSBK',1,'102','102-1'),(129,'Sách - Mahabharata bằng hình - Thiên sử thi vĩ đại nhất của Ấn Độ','NXB Dân Trí',2021,'Tiếng Việt','Được coi là bộ Vệ Đà thứ 5 trong hệ thống kinh điển Ấn Độ giáo - hệ thống tôn giáo phức tạp và lớn thứ 3 trên thế giới, với cộng đồng khoảng hơn 1,2 tỷ người - Mahabharata truyền tải những chân lý của 4 pho Vệ Đà dưới dạng câu chuyện hấp dẫn. Bộ sử thi này giữ một vị trí quan trọng và còn gây ảnh hưởng đến nhiều mặt trong cả văn hoá nghệ thuật và đời sống ngày nay.','TPKD',1,'102','102-3'),(130,'Toàn Chân Triết Luận','NXB Trẻ',2018,'Tiếng Việt','Cuốn sách thể hiện những quan niệm triết học về vũ trụ, nhân sinh con người như tốt xấu, họa phúc, giàu nghèo dưới cái nhìn của Đạo học Đông phương.','PSBK',1,'102','102-1'),(131,'Tự tình cùng cái đẹp','NXB Trẻ',2021,'Tiếng Việt','Thoạt đọc \"Tự tình cùng Cái Đẹp\" của Chu Văn Sơn thấy mỗi bài viết đều gắn liền với một địa danh cụ thể, những tưởng đó là du kí. Nhưng đọc sâu vào từng trang viết, hóa ra vẻ ngoài du kí kia chỉ là cái cớ để cho kẻ viết phơi trải những cảm và nghĩ bời bời của mình về cõi sống, về cái Đẹp đó đây trong cõi sống này.','PSBK',1,'102','102-1'),(132,'Tôi Tự Học (Tái Bản)','NXB Trẻ',2021,'Tiếng Việt','Sách “Tôi tự học” của tác giả Nguyễn Duy Cần đề cập đến khái niệm, mục đích của học vấn đối với con người đồng thời nêu lên một số phương pháp học tập đúng đắn và hiệu quả. Tác giả cho rằng giá trị của học vấn nằm ở sự lĩnh hội và mở mang tri thức của con người chứ không đơn thuần thể hiện trên bằng cấp. Trong xã hội ngày nay, không ít người quên đi ý nghĩa đích thực của học vấn, biến việc học của mình thành công cụ để kiếm tiền nhưng thực ra nó chỉ là phương tiện để đưa con người đến thành công mà thôi. Bởi vì học không phải để lấy bằng mà học còn để “biết mình” và để “đối nhân xử thế”.','GD',3,'302','302-2'),(133,'Mình Nói Gì Khi Nói Về Hạnh Phúc?','NXB Hội Nhà Văn',2018,'Tiếng Việt','','TDKNS',3,'302','302-3'),(134,'Tuổi Trẻ Đáng Giá Bao Nhiêu?','NXB Hội Nhà Văn',2018,'Tiếng Việt','Hồi trẻ chúng ta luôn luôn coi nhẹ phần mở đầu, đến khi kết thúc lại đau đớn tê tái. Còn khi đã trưởng thành, chín chắn, chúng ta có thể né tránh sự tổn thương ấu trĩ, nhưng cũng đã để mất đi dũng khí thuở ban đầu.\"','TDKNS',3,'302','302-3'),(135,'Thanh xuân mình học được gì','NXB Hội Nhà Văn',2020,'Tiếng Việt','“Thanh xuân mình học được gì” là cuốn sách đầu tay của mình – Sâu Đỏ, một tác giả không hề có tên tuổi trong làng văn Việt Nam. Tên sách nói lên tất cả, cuốn sách tập hợp 5 bài học và 20 câu chuyện mà mình đã học được, nghe được trong quãng đời thanh xuân của mình, xảy ra chủ yếu trong khoảng thời gian từ năm 18 đến 29 tuổi. Phần I của cuốn sách bao gồm các bài học về công tác chuẩn bị bước vào đời, về đối diện với thất bại, về lựa chọn khi đứng ở ngã ba đường, về niềm tin vào bản thân, và về việc kết nối các dấu mốc trong cuộc đời. Phần II gồm 20 câu chuyện về con người và cuộc sống mà mình đã cân nhắc chọn lọc kỹ nhằm nêu bật những thông điệp mà mình muốn truyền tải đến mọi người. Một số thông điệp trong số đó là hãy giữ gìn sức khỏe, hãy lịch sự, đọc sách, học ngoại ngữ, bảo vệ môi trường, làm thiện nguyện, không đầu hàng trước số phận, bước ra khỏi vùng an toàn để trải nghiệm những điều mới mẻ, trân trọng tình cảm gia đình, và quan trọng nhất là, hãy sống yêu thương mọi người.','PSBK',1,'102','102-1'),(136,'Lấy Nhau Vì Tình (Tái bản 2021)','NXB Hà Nội',2021,'Tiếng Việt','Tiểu thuyết “Lấy nhau vì tình” cổ điển, lãng mạn mà hiện đại. Đó là câu chuyện về tình yêu lứa đôi của các cô cậu tân thời nơi phố thị, thể hiện khát vọng tự do yêu đương và hôn nhân tự nguyện, dường như là đi ngược với quan niệm về hôn nhân truyền thống.','TT',1,'102','102-3'),(137,'Giông Tố (Tái Bản)','NXB Hà Nội',2013,'Tiếng Việt','Cuốn sách này mang tính chất của một công trình văn bản học. Người ta biết rằng, văn bản học như một ngành của ngữ văn học, vốn thiên về thực hành; nó gắn với thực tiễn xuất bản, gắn với việc công bố các tác phẩm viết bằng chữ; vì vậy hầu hết các nhà chuyên môn về biên tập sách, ở mức nhất định, đều can dự đến công tác văn bản. Tuy vậy, cho đến nay, cả trong giới làm biên tập sách lẫn giới nghiên cứu văn học ở ta hầu như chỉ có rất ít chuyên gia về văn bản.','TPKD',1,'102','102-3'),(138,'Trúng Số Độc Đắc','NXB Hà Nội',2000,'Tiếng Việt','','TT',1,'102','102-3'),(139,'Dứt Tình','NXB Hà Nội',2019,'Tiếng Việt','Năm 1934, Vũ Trọng Phụng có tiểu thuyết đầu tay Dứt tình (còn có tên khác là Bởi không duyên kiếp) đăng trên tờ Hải Phòng tuần báo. Với tiểu thuyết này, Vũ Trọng Phụng được khen là “ngòi bút tả chân thực đã khéo léo”.\"Dứt tình\" là cuốn tiểu thuyết mang tư tưởng định mệnh siêu hình.','TT',1,'102','102-3'),(140,'Vỡ Đê','NXB Hà Nội',2019,'Tiếng Việt','Vỡ đê phản ánh hiện thực trên một phạm vi khá rộng, từ thành thị đến nông thôn, song tập trung lên án những chính sách, thủ đoạn thống trị của bọn thực dân, quan lại đã đẩy người nông dân vào tình cảnh đói rét cơ cực. Một tác phẩm hiện thực phê phán của Vũ Trọng Phụng đã cho người đọc thấy lại những ngày tăm tối của dân tộc ta dưới ách thống trị của thực dân phong kiến trong giai đoạn trước 1945.','TPKD',1,'102','102-3'),(141,'Tiếng Anh Lớp 9','NXB Giáo Dục Việt Nam',2011,'Tiếng Việt','Tiếng Anh Lớp 9 là một trong những cuốn sách giáo khoa lớp cơ bản được biên soạn theo chương trình chuẩn của Bộ Giáo Dục & Đào Tạo.','SGKC2',2,'201','201-2'),(142,'Toán 7