ành Cho Bậc Đại Học Hệ Chuyên Lý Luận Chính Trị','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','GTDHCD',2,'201','201-2'),(162,'Giáo Trình Triết Học Mác – Lênin (Dành Cho Bậc Đại Học Hệ Chuyên Lý Luận Chính Trị)','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','GTDHCD',2,'201','201-2'),(163,'Giáo Trình Tư Tưởng Hồ Chí Minh (Dành Cho Bậc Đại Học Hệ Không Chuyên Lý Luận Chính Trị','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','GTDHCD',2,'201','201-2'),(164,'Giáo Trình Triết Học Mác – Lênin (Dành Cho Bậc Đại Học Hệ Không Chuyên Lý Luận Chính Trị)','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','GTDHCD',2,'201','201-2'),(165,'Giáo Trình Lịch Sử Đảng Cộng Sản Việt Nam (Dành Cho Bậc Đại Học Hệ Chuyên Lý Luận Chính Trị)','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','GTDHCD',2,'201','201-2'),(166,'Giáo Trình Kinh Tế Chính Trị Mác – Lênin (Dành Cho Bậc Đại Học Hệ Không Chuyên Lý Luận Chính Trị)','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','GTDHCD',2,'201','201-2'),(167,'Giáo Trình Chủ Nghĩa Xã Hội Khoa Học (Dành Cho Bậc Đại Học Hệ Chuyên Lý Luận Chính Trị)','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','GTDHCD',2,'201','201-2'),(168,'Marketing Căn Bản','NXB Lao Động',2017,'Tiếng Việt','','SMBH',3,'301','301-3'),(169,'Kết Thúc Bán Hàng – Đòn Quyết Định','NXB Lao Động',2017,'Tiếng Việt','','SMBH',3,'301','301-3'),(170,'Thiết Kế Lấy Người Dùng Làm Trung Tâm','NXB Lao Động',2021,'Tiếng Việt','','SMBH',3,'301','301-3'),(171,'Những Đòn Tâm Lý Trong Bán Hàng','NXB Lao Động',2021,'Tiếng Việt','','SMBH',3,'301','301-3'),(172,'Đừng Bán Sản Phẩm, Hãy Bán Giải Pháp','NXB Lao Động',2021,'Tiếng Việt','','SMBH',3,'301','301-3'),(173,'Marketing Truyền Miệng','NXB Lao Động',2019,'Tiếng Việt','','SMBH',3,'301','301-3'),(174,'Dẫn Đầu Hay Là Chết','NXB Lao Động',2019,'Tiếng Việt','','SMBH',3,'301','301-3'),(175,'Thế Giới Ảo, Thương Hiệu Thật','NXB Lao Động',2019,'Tiếng Việt','','SMBH',3,'301','301-3'),(176,'Chết Vì Chứng Khoán','NXB Lao Động',2019,'Tiếng Việt','ý chí giúp chúng ta đạt được mục đích, chứ không phải trí tuệ. Tài năng và may mắn chưa đủ. Chỉ có sự quyết tâm làm việc chăm chỉ và nhẫn nại mới có thể thực hiện được những việc không thể. Không có con đường tắt; không có cách nào dễ dàng. Đặc biệt là khi bạn khám phá thị trường cổ phiếu.','STCTT',3,'301','301-4'),(177,'Cổ Phiếu Thường, Lợi Nhuận Phi Thường','NXB Lao Động',2019,'Tiếng Việt','Philip Fisher là một trong số các nhà đầu tư có ảnh hưởng lớn nhất mọi thời đại. Triết lý đầu tư của ông không chỉ được nhiều chuyên gia hiện đại nghiên cứu và áp dụng mà còn được rất nhiều nhà đầu tư coi đó là cẩm nang dẫn đường cho bản thân. Những triết lý này đã được tập hợp trong cuốn sách nổi tiếng của ông - Cổ phiếu thường, Lợi nhuận phi thường (Common Stocks and Uncommon Profits), một trong những giáo trình đầu tư kinh điển dành cho các nhà đầu tư hiện đại. Cuốn sách sẽ mang lại cho bạn một cái nhìn toàn diện, từ những vấn đề hết sức cụ thể như sức mạnh của “lời đồn đại”, nên mua gì, khi nào, những điều nhà đầu tư cần tránh, cách tìm ra một cổ phiếu tiềm năng… cho đến phương pháp hình thành một triết lý đầu tư đem lại hiệu quả cao. Fisher đã chỉ ra rằng có hai cách để thu được lợi nhuận đầu tư lớn nhất: thứ nhất là mua cổ phiếu khi thị trường đi xuống và đợi lúc thị trường hồi phục; hoặc áp dụng cách thứ hai ít rủi ro hơn và lợi nhuận tiềm năng lớn hơn, đó là đầu tư vào một số công ty đang tăng trưởng liên tục và thu lợi nhuận hàng năm. Để tìm được chính xác những công ty như vậy, ông cũng đưa ra 15 luận điểm lựa chọn cổ phiếu và những thành tố cần có cho một khoản đầu tư hiệu quả. Có thể nói Cổ phiếu thường, Lợi nhuận phi thường sẽ làm thay đổi cách nhìn nhận của bạn về thị trường tài chính, một cuốn sách xứng đáng có một vị trí trang trọng trên giá sách của các nhà đầu tư và bất cứ ai quan tâm đến lĩnh vực này.','STCTT',3,'301','301-4'),(178,'Những Ông Trùm Tài Chính','NXB Lao Động',2016,'Tiếng Việt','Những ông trùm tài chính đưa ra một cái nhìn mới về bản chất của cuộc khủng hoảng toàn cầu và còn là lời nhắc nhở chúng ta về những tác động to lớn tiềm ẩn từ các quyết định của một số ít chủ ngân hàng, sai lầm của họ, và về nhưng hậu quả khủng khiếp có thể xảy ra ảnh huorng đến cả nhân loại.','STCTT',3,'301','301-4'),(179,'Forex 101 - Mọi Điều Cần Biết Về Thị Trường Ngoại Hối','NXB Lao Động',2020,'Tiếng Việt','Hàng chục năm trước, khi thị trường Ngoại hối bắt đầu trở nên phổ biến hơn với công chúng, nó đã thực sự là khám phá lớn đối với nhiều người. Liệu một người chỉ sở hữu vài nghìn đô-la có thể tiến hành giao dịch như mọi thành phần khác đang tham gia vào thị trường đồng thời vén lên bức màn mờ ảo vẫn che phủ thế giới của các hoạt động trao đổi tiền tệ để tìm kiếm lợi nhuận cho bản thân?','STCTT',3,'301','301-4'),(180,'Bọn Rợ Rình Trước Cổng: Mua Lại Có Đòn Bẩy Và Thương Vụ Đình Đám RJR Nabisco','NXB Lao Động',2020,'Tiếng Việt','Nội dung chính nói về việc mua lại có đòn bẩy (LBO) của tập đoàn RJR Nabisco với nhịp độ nhanh chóng và chi tiết, bao gồm cả những cuộc hội thoại riêng cũng như trong phòng họp giữa các CEO của các công ty. Cuốn sách thể hiện lòng tham đáng kinh ngạc của các chủ ngân hàng đầu tư, nhà quản lý công ty, nhà đầu tư cổ phần tư nhân, các cổ đông… Việc mua lại diễn ra được mở đầu bằng một cuộc chiến đấu thầu giữa ban lãnh đạo (do CEO Ross Johnson dẫn đầu), KKR, công ty cổ phần tư nhân lâu đời, và một số người chơi “nhỏ hơn”.','STCTT',3,'301','301-4'),(181,'Đến Starbucks Mua Cà Phê Cốc Lớn','NXB Thế Giới',2020,'Tiếng Việt','Đến Starbucks, bạn sẽ gọi một ly cà phê cỡ lớn hay cỡ nhỏ? Khi đi xem phim, bạn sẽ mua bịch bắp rang bơ cỡ to hay cỡ nhỏ? Lúc cần mua trà giải khát, bạn sẽ đến siêu thị cách xa hay đến tiệm tạp hóa cạnh nhà? Những vấn đề này có lẽ bạn sẽ cảm thấy vụn vặt và chẳng đáng quan tâm, nhưng tác giả đã thông qua việc phân tích những ví dụ đời thường nhất trong cuộc sống hằng ngày để nói với chúng ta rằng: ngoài việc cố kiếm thật nhiều tiền, thì tiêu tiền một cách thông minh chính là tuyệt chiêu tốt nhất để ứng phó với tình trạng lạm phát đang lan tràn hiện nay.','STCTT',3,'301','301-4'),(182,'24 Bài Học Sống Còn Để Đầu Tư Thành Công Trên Thị Trường Chứng Khoán','NXB Lao Động',2020,'Tiếng Việt','','STCTT',3,'301','301-4'),(183,'BANK 4.0 - Ngân Hàng Số: Giao Dịch Mọi Nơi, Không Chỉ Ở Ngân Hàng','NXB Lao Động',2020,'Tiếng Việt','Bank 4.0 khám phá sự chuyển đổi căn bản đã diễn ra trong ngành ngân hàng và dự đoán tương lai của nó. Ngân hàng sẽ trông như thế nào sau 30, 50 năm nữa? Các ngân hàng tốt nhất trên thế giới đang phản ứng với sự chuyển đổi này; nhiều cơ quan quản lý đang điều chỉnh lại các quy trình kiểm soát, cấp phép và quy định; những công ty khởi nghiệp FinTech đang tái xác lập vị thế của nó đối với ngành ngân hàng hiện nay. Các ngân hàng đang bị buộc phải phát triển các khả năng mới, công việc mới và kỹ năng mới – và đó là một thế giới hoàn toàn mới. Tương lai của ngân hàng không nằm ở các cửa hàng giá trị, tiện ích thanh toán và tín dụng mới, nó được nhúng trong các trợ lý thông minh dựa trên giọng nói như Alexa và Siri, sẵn sàng 24/7 để giúp con người thanh toán, đặt chỗ, giao dịch hoặc hỏi thăm. Ngân hàng 4.0 có nghĩa là ngân hàng của bạn được nhúng vào thế giới của bạn hoặc không.','STCTT',3,'301','301-4'),(184,'Đầu tư bất động sản','NXB Lao Động',2020,'Tiếng Việt','Bằng việc cung cấp tất cả thông tin và chiến lược cần thiết trong đầu tư bất động sản, đây là cuốn cẩm nang thiết thực và toàn diện nhất trong sự nghiệp kinh doanh bất động sản của bạn. Một cuốn sách hữu ích giúp bạn có thể thu lợi nhuận tối đa trong kinh doanh bất động sản…','STCTT',3,'301','301-4'),(185,'Tôi Đã Kiếm Được 2.000.000 Đô-La Từ Thị Trường Chứng Khoán Như Thế Nào?','NXB Hồng Đức',2021,'Tiếng Việt','Điều đặc biệt của cuốn sách là các kinh nghiệm của tác giả được trình bày rất cô đọng, có dẫn chứng thuyết phục qua ngôn từ dễ hiểu song vẫn chứa đựng các nội dung mang tính hàn lâm trong phân tích và đầu tư chứng khoán. Qua cuốn sách, người đọc cũng sẽ hiểu được các vấn đề lý thuyết về phân tích cơ bản, phân tích kỹ thuật, kỹ năng giao dịch và chiến lược đầu tư chứng khoán được áp dụng linh hoạt trong thực tế đầu tư chứng khoán như thế nào. Người đọc sẽ có cơ hội biết về Lý thuyết hộp của Nicolas Darvas và những ứng dụng tuyệt vời của nó trong đầu tư chứng khoán.','STCTT',3,'301','301-4'),(186,'Trải Nghiệm Nhân Viên Hoàn Hảo - Bí mật thu hút nhân tài cho doanh nghiệp','NXB Hồng Đức',2021,'Tiếng Việt','Cuốn sách Trải Nghiệm Nhân Viên Hoàn Hảo - Bí mật thu hút nhân tài cho doanh nghiệp của tác giả Jacob Morga – Chuyên gia huấn luyện nhân sự sẽ chia sẻ những kiến thức, kinh nghiệm quý báu về TRẢI NGHIỆM NHÂN VIÊN của ông qua việc nghiên cứu hơn 150 công ty, tập đoàn lớn trên thế giới như Honda, Apple, Adobe, Microssof…','SQTNL',3,'301','301-4'),(187,'Nhà Lãnh Đạo Tương Lai','NXB Thế Giới',2021,'Tiếng Việt','Các nhà lãnh đạo sở hữu những kỹ năng và mô thức tư duy trong quyển sách này và giúp người khác làm được điều tương tự đều nhận ra rằng chúng không chỉ giúp kiến tạo tổ chức thành nơi mọi nhân viên đều muốn bước vào làm việc và cống hiến mỗi ngày, mà nó còn giúp xây dựng một thế giới mà tất cả chúng ta đều tự hào được sống trong nó và tận hưởng nó. Đây là lúc bước ra khỏi chuyến tàu vạn dặm của bạn.','SQTNL',3,'301','301-4'),(188,'Nguyên Tắc Củ Cà Rốt - Nghệ Thuật Thúc Đẩy Nhân Viên Đạt Hiệu Suất Phi Thường','NXB Hồng Đức',2021,'Tiếng Việt','Cà-rốt là loại củ hầu như không thể thiếu trong bữa ăn của các gia đình Âu - Mỹ. Sở dĩ cà-rốt chiếm vị trí quan trọng như thế nào trên bàn ăn của họ là vì, như đa số chúng ta đều biết, nó là loại thức ăn vừa bổ dưỡng vừa chứa nhiều loại vitamin thiết yếu có thể giúp cơ thể duy trì sức khoẻ và sự thông minh. Nếu cà-rốt cần thiết cho mọi người, mọi giới, mọi lúc, mọi nơi thì tuyên dương - khen thưởng, theo 2 tác giả Gostick và Elton, cũng thế. Thật vậy, một lời khen chân thành, đúng lúc có thể biến một người bình thường thành bậc kỳ tài. Một phần thưởng thoả đáng, đúng người không những giúp bạn giữ được nhân viên giỏi mà còn là một đòn bẩy hữu hiệu để tăng năng suất lao động và duy trì sự phát triển bền vững của công ty, tổ chức bạn. Điểm mấu chốt đối với một nhà quản lý là: Quản lý chỉ thực sự đem lại hiệu quả tốt khi sự ghi nhận được thêm vào cùng các phẩm chất lãnh đạo khác. Đây chính là Nguyên tắc củ cà rốt - một khái niệm đơn giản nhưng lúc nào cũng hiệu quả.','SQTNL',3,'301','301-4'),(189,'OJT: Công cụ phát triển nguồn nhân lực kế thừa - Tặng kèm sổ tay mục tiêu, kế hoạch','NXB Hồng Đức',2021,'Tiếng Việt','OJT là viết tắt của cụm từ On the Job Training. Đây là một công cụ giúp thực hiện nhanh các bước đào tạo cho nhân viên. Phương thức của On the Job Training chính là kèm cặp, hướng dẫn tại chỗ giúp nhân viên nhất là người mới nắm rõ được công việc cụ thể một cách nhanh nhất từ đó “vào việc” hiệu quả, năng suất.','SQTNL',3,'301','301-4'),(190,'Đế Chế Alibaba - Bí Mật Quản Trị Nhân Lực Để Tạo Ra Một Đội Quân Bách Chiến Bách Thắng','NXB Hồng Đức',2021,'Tiếng Việt','Khi khởi đầu, Alibaba thiếu vốn, công nghệ, và kế hoạch hoạt động. Những khó khăn này như báo hiệu cho một thất bại nhãn tiền. Nhưng tầm nhìn của Jack Ma cho phép ông mơ giấc mơ lớn, cái giúp doanh nghiệp này trở thành một kinh doanh khổng lồ. Như ông đã chia sẻ, mục tiêu cuối cùng là “đánh bại eBay, thâu tóm Yahoo và cản bước tiến của Google”. Phong cách lãnh đạo đầy cảm hứng của Jack Ma đã để lại tầm ảnh hưởng sâu rộng cho rất nhiều doanh nghiệp non trẻ mới bước đầu khởi nghiệp.','SQTNL',3,'301','301-4'),(191,'Kỹ Năng Quản Lý Nhân Sự Chuyên Nghiệp','NXB Lao Động',2019,'Tiếng Việt','Trong cuốn sách này, Whitney Johnson – người từng có 20 năm huấn luyện, đầu tư và tư vấn, đã giới thiệu các cách để trở thành một trong những nhà quản lý giỏi và xây dựng đội ngũ nhân viên làm việc hiệu quả và năng suất.','SQTNL',3,'301','301-4'),(192,'Tuyển Đúng Dùng Hay - Nghệ Thuật Quản Trị Nguồn Nhân Lực','NXB Dân Trí',2021,'Tiếng Việt','Kỷ nguyên số với trí tuệ nhân tạo, người máy và các công nghệ trao đổi dữ liệu giữa không gian ảo và môi trường thực đã và đang cắt giảm công việc của con người ở tất cả các ngành nghề trong xã hội. Nhưng dù công nghệ có phát triển đến mấy thì vẫn có những vị trí mà máy móc không bao giờ có thể thay thế con người, đó chính là những nhân sự cấp Chiến lược của mọi doanh nghiệp. Đặc biệt, với hầu hết các ngành dịch vụ như hàng không, y tế, khách sạn – nhà hàng… thì dù công nghệ có tiến bộ đến đâu cũng không thể thay thế được đội ngũ người lao động trực tiếp phục vụ khách hàng. Bởi vì sản phẩm cốt lõi của các ngành dịch vụ này là tạo ra cho khách hàng những cảm xúc trải nghiệm, mà chỉ có con người mới có thể tạo ra cảm xúc cho con người. Không một cỗ máy nào, dù chính xác hay tốc độ đến đâu, có thể làm thay được điều đó.','SQTNL',3,'301','301-4'),(193,'Quản Trị Nguồn Nhân Lực','NXB Tài Chính',2021,'Tiếng Việt','Cuốn sách được trình bày cô đọng, dễ hiểu và hấp dẫn trong mười hai chương. Chương đầu tiên giới thiệu khái quát về quản trị nguồn nhân lực , chín chương tiếp theo được chia làm ba phần, tương ứng với ba nhóm chức năng quan trọng nhất của quản trị nguồn nhân lực trong các tổ chức: thu hút; đào tạo và phát triển; và duy trì nguồn nhân lực. Phần thứ tư “Quản trị nguồn nhân lực trong môi trường hiện đai” gồm có hai chương “Quản trị nguồn nhân lực quốc tế” và “Đánh giá kết quả quản trị nguồn nhân lực ”. Phần cuối cùng gồm có các tình huống tổng hợp nhằm kết nối toàn bộ các vấn đề chức năng trong quản trị nguồn nhân lực của các doanh nghiệp dành riêng cho các chương trình đào tạo Quản trị nguồn nhân lực nâng cao.','SQTNL',3,'301','301-4'),(194,'KPI Thước Đo Mục Tiêu Trọng Yếu (Key Performance Indicators)','NXB Tổng hợp TP.HCM',2020,'Tiếng Việt','Nằm trong bộ sách “Triển khai chiến lược” do PACE dày công tìm kiếm, nghiên cứu và chọn lọc, có thể nói KPI – Thước đo mục tiêu trọng yếu (Key Performance Indicators) là quyển sách được thực hiện công phu nhất, đầy đủ nhất và phổ biến nhất hiện nay. Cuốn sách này được biên soạn nhằm hỗ trợ các tổ chức trong việc xây dựng, triển khai và sử dụng hiệu quả các Thước đo Mục tiêu Trọng yếu (Key Performance Indicators; viết tắt KPI) – các thước đo hiệu quả công việc sẽ tạo ra sự khác biệt sâu sắc cho tổ chức của bạn.','SQTNL',3,'301','301-4'),(195,'Nghề Nhân Sự Việt - Nghìn Lẻ Chuyện Giờ Mới Kể','NXB Công Thương',2021,'Tiếng Việt','Lần đầu tiên những người làm nghề Nhân Sự tại Việt Nam không ngần ngại “kể” lại các câu chuyện xúc động, thấm đậm tình người đã đi theo họ cùng năm tháng suốt cuộc đời làm nghề. Các câu chuyện được kể lại một cách chân thật, mộc mạc, nhưng cũng để lại những cảm nhận và nhiều bài học sâu sắc về chữ “Nhân”, chữ “Tâm” trong cuộc sống. Cuốn sách là tập hợp các bài viết hấp dẫn, sinh động của nhóm tác giả Câu lạc bộ Nhân sự Việt Nam – Vietnam Human Resources Association (VNHR).','SQTNL',3,'301','301-4'),(196,'Án Mạng Trên Chuyến Tàu Tốc Hành Phương Đông','NXB Trẻ',2017,'Tiếng Việt','Vừa quá nửa đêm, chuyến tàu tốc hành phương Đông nổi tiếng buộc phải ngừng lại vì tuyết rơi quá dày. Vào buổi sáng, tay triệu phú Simon Ratchett được phát hiện nằm chết trong toa riêng của mình với mười hai nhát dao, cửa khoang được khóa từ bên trong. Một trong những hành khách có mặt trên chuyến tàu là thủ phạm.','TTT',1,'102','102-4'),(197,'Chuỗi Án Mạng A.B.C','NXB Trẻ',2017,'Tiếng Việt','Trong một câu chuyện có vẻ như không can hệ gì, một người bán rong tên Alexander Bonaparte Cust đã có mặt ở tất cả những địa điểm xảy ra án mạng và ngày tội ác đó diễn ra. Cust bị trúng đạn vào đầu lúc đi lính. Hậu quả là, ông bị mất trí nhớ, đau đầu và bị động kinh. Liệu một người ngờ nghệch như thế có thể là kẻ giết người mệnh danh ABC không?','TTT',1,'102','102-4'),(198,'Hẹn Với Thần Chết','NXB Trẻ',2019,'Tiếng Việt','Đi nghỉ ở Jerusalem, Poirot nghe lỏm Raymond Boynton nói với em gái: “Phải giết chết bà ta, hiểu rồi phải không?” Mẹ kế của họ, bà Boynton, là một bạo chúa tàn ác khống chế cả gia đình. Khi người ta phát hiện bà bị chết trong lúc ở Petra, Poirot đề nghị giải quyết vụ án trong vòng hai mươi bốn giờ, dù ông không cách nào chứng tỏ ngay rằng đây có phải là một vụ giết người không.','TTT',1,'102','102-4'),(199,'Kỳ Án Dòng Chữ Tắt','NXB Trẻ',2021,'Tiếng Việt','Hercule Poirot nghỉ ẩn ở London tại một nhà trọ ít ai ngờ đến. Tình cờ, cùng nhà trọ với ông có cảnh sát điều tra Edward Catchpool của Scotland Yard. Và cũng tình cờ ông gặp người phụ nữ tên Jennie, hốt hoảng như trong tình trạng bị nguy hiểm. Nhưng tất cả không còn là tình cờ nữa khi xảy ra vụ án mạng ba người chết tại khách sạn Bloxham và Catchpool phụ trách điều tra. Ngay từ đầu Poirot khẳng định người phụ nữ tên Jennie có liên quan đến vụ giết ba người ở khách sạn đó, nhưng Catchpool một mực bác đi, khiến cho ông thám tử già lừng danh định đi nghỉ ẩn này lại phải nhảy vào cuộc. Vụ điều tra mở ra cả một ân oán tình thù 16 năm trước tại một làng quê nước Anh mà kết cuộc bi thảm là cái chết của vợ chồng cha xứ ở tuổi rất trẻ, và một số người tha phương lưu lạc để quên đi tội lỗi của mình…','TTT',1,'102','102-4'),(200,'Và Rồi Chẳng Còn Ai ','NXB Trẻ',2021,'Tiếng Việt','“Mười…” Mười người bị lừa ra một hòn đảo nằm trơ trọi giữa biển khơi thuộc vịnh Devon, tất cả được bố trí cho ở trong một căn nhà. Tác giả của trò bịp này là một nhân vật bí hiểm có tên “U.N.Owen”.','TTT',1,'102','102-4'),(201,'Án Mạng Ở Nhà Mục Vụ','NXB Trẻ',2016,'Tiếng Việt','Đại tá Protheroe, viên chức tư pháp đồng thời là người quản lý tài sản cho nhà thờ bị mọi người trong làng St. Mary Mead ghét. Vào ngày hẹn kiểm kê sổ sách với mục sư quản nhiệm, đại tá Protheroe bị bắn vào đầu, chết ngay trong văn phòng làm việc của mục sư, gục lên trên một bức thư viết dở gửi cho ông mục sư. Vậy là các bà cô già không chồng trong làng có nhiều việc để làm! Ngay sau khi cảnh sát vào việc, có hai kẻ nối tiếp nhau đầu thú: anh chàng họa sĩ Lawrence Redding và bà vợ góa của ông đại tá. Cả hai người này tư tình với nhau từ trước khi ông đại tá bị giết, thế nên chẳng nghi ngờ gì nếu họ là những kẻ tình nghi số 1. Đường dây vụ án càng lúc càng rối tung vì phát hiện thêm rất nhiều nhân vật khả nghi hơn, từ viên trợ tế trẻ tuổi của nhà thờ cho đến một mệnh phụ bí ẩn mới dọn về làng này sống chưa lâu… Ông mục sư Clement ngoài việc hợp tác với cảnh sát điều tra vụ án, còn luôn bị các bà cô già mời tới gặp riêng để báo cáo những tình tiết mới phát hiện, mà thường toàn là những kể lể dông dài kèm chỉ trích cay nghiệt! Duy chỉ có bà Marple, bà già sắc sảo và cũng \"nhiều chuyện\" nhất cái làng St. Mary Mead đó có cách tư duy manh mối tài tình, hiến kế để cảnh sát đặt bẫy dụ kẻ giết người lộ diện.','TTT',1,'102','102-4'),(202,'Ngôi Nhà Quái Dị ','NXB Trẻ',2021,'Tiếng Việt','Gia đình ba thế hệ của ông già Leonides cùng sống trong căn nhà “ba đầu hồi” quái dị do ông tự thiết kế. Leonides là một doanh nhân thành đạt giàu có, bảo bọc cho gia đình hai con trai Roger và Philip, ba đứa cháu con của Philip. Ông có hai đời vợ. Vợ trước mất do bị trúng bom thời chiến tranh, cô em gái không lấy chồng của bà vợ này đến giúp anh rể chăm sóc các cháu. Khi các cháu đã lớn cả, ở tuổi 80 ông Leonides lại đi bước nữa với một phụ nữ trẻ đẹp. Rồi một anh gia sư trạc tuổi bà vợ sau của ông xuất hiện trong gia đình, những ghét bỏ khinh khi lâu nay của các con cháu ông Leonides bùng lên với đồn đoán về cuộc tình vụng trộm giữa bà mẹ kế trẻ đẹp và anh gia sư. Giữa lúc đó ông Leonides bị chết do tiêm nhầm thuốc! Bác sĩ từ chối chứng tử vì dứt khoát nghi ngờ đây là một vụ giết người. Cảnh sát tiến hành điều tra và điên đầu vì bất cứ ai trong gia đình đó cũng có động cơ giết ông Leonides… Ngoài ra, di chúc ông đã đọc cho con cháu nghe và đã ký tên biến mất?','TTT',1,'102','102-4'),(203,'Bóng Ma Trong Nhà Hát Opera','NXB Văn Học',2018,'Tiếng Việt','Những lời đồn đại ma quái về một “Bóng ma trong nhà hát opera” khiến tất cả sợ hãi khi nữ ca sĩ trẻ trung xinh đẹp Christine Daaé đột nhiên biến mất sau màn trình diễn thành công. Nỗi sợ hãi, khủng hoảng và bạo lực càng tăng lên trong cánh gà sau sân khấu Nhà hát Opera Paris khi bóng ma đe dọa tấn công một lần nữa.','TTT',1,'102','102-4'),(204,'Bá Tước Dracula','NXB Dân Trí',2020,'Tiếng Việt','Bá Tước Dracula ( Bìa Mềm ) \" Dracula\" là một cuốn tiểu thuyết kinh dị gothic năm 1897 của tác giả người Ireland Bram Stoker , nổi tiếng với nhân vật ma cà rồng bá tước Dracula . Cuốn tiểu thuyết kể về hành trình từ Transylva-nia đến Anh để săn lùng những con mồi mới và gieo rắc lời nguyền của Dracula và cuộc chiến giữa hắn và nhóm giáo sư Abraham Van Helsing . Cuốn tiểu thuyết đề cao vai trò của phụ nữ trong văn hoá Victoria, chủ nghĩa thực dân và chủ nghĩa hậu thực dân . Mặc dù không sáng tạo ra ma cà rồng , nhưng tác phẩm của Stoker đã định ra hình thức hiện đại của nó và tạo ra nhiều diễn giải được áp dụng trong sân khấu , phim ảnh và truyền hình sau này .','TTT',1,'102','102-4'),(205,'Sherlock Holmes Tập 1','NXB Văn Học',2021,'Tiếng Việt','','TTT',1,'102','102-4'),(206,'Sherlock Holmes Tập 2','NXB Văn Học',2021,'Tiếng Việt','','TTT',1,'102','102-4'),(207,'Sherlock Holmes Tập 3','NXB Văn Học',2021,'Tiếng Việt','','TTT',1,'102','102-4'),(208,'Thung Lũng Kinh Hãi','NXB Văn Học',2021,'Tiếng Việt','','TTT',1,'102','102-4'),(209,'Án Mạng Mười Một Chữ','NXB Hà Nội',2020,'Tiếng Việt','Tình cờ phát hiện những điều bất thường sau cái chết thảm khốc của người yêu, nhân vật “tôi”, một nữ nhà văn viết tiểu thuyết trinh thám đã cùng bạn mình, Hagio Fuyuko, cũng là biên tập viên phụ trách sách của “tôi” quyết định điều tra về cái chết này. Trong quá trình điều tra hai người phát hiện người yêu của “tôi” đã từng gặp tai nạn lật thuyền trong chuyến du lịch đảo một năm trước. Và khi họ tìm tới những người cũng tham gia chuyến đi đó để tìm hiểu thì những người này cũng lần lượt bị sát hại. Cuối cùng “tôi” buộc phải tự mình phán đoán, điều tra để tìm ra chân tướng sự việc.','TTT',1,'102','102-4'),(210,'Vụ Án Mạng Ở Nhà Khách Núi Hakuba','NXB Hà Nội',2020,'Tiếng Việt','Naoko, cô em gái đang là sinh viên đại học, vẫn luôn ôm mối hoài nghi về cái chết của anh trai. Cô cùng người bạn thân Makoto của mình đến thăm nhà khách “Mẹ Ngỗng” ở núi Hakuba thuộc tỉnh Nagano, nơi anh mình đã qua đời. Lạ lùng thay, nhà khách lại đón tiếp những vị khách quen thuộc hệt như một năm trước đó. Bí mật nào đang ẩn nấp sau những bài đồng dao Mẹ Ngỗng trong mỗi căn phòng? Quá khứ nào đang được giấu kín trong nhà khách?','TTT',1,'102','102-4'),(211,'Nghìn Lẻ Một Đêm (Tái Bản)','NXB Văn Học',2021,'Tiếng Việt','Bắt nguồn từ một cuốn sách cổ tên là Hezār Afsān (Một ngàn truyện), pho sách đồ sộ Nghìn lẻ một đêm tập hợp những câu chuyện dân gian kỳ ảo có xuất xứ từ Ả Rập, Ba Tư và Hy Lạp, được lưu truyền bởi những người Ai Cập kể chuyện rong vào thế kỷ XII và XIII, có nội dung phong phú, chủ đề đa dạng và từ ngữ sáng sủa. Về nội dung, Nghìn lẻ một đêm mở ra một thế giới đa sắc màu với đủ các khuôn mặt từ thần tiên đến con người, từ nhà quý tộc đến người bình dân trong xã hội Ả Rập thời Trung cổ. Về nghệ thuật, tác phẩm có một kết cấu hết sức hoàn chỉnh, mạch truyện hấp dẫn với nhiều tình tiết kịch tính và bất ngờ, cùng ngôn ngữ kể chuyện điêu luyện. Kể từ khi xuất hiện, Nghìn lẻ một đêm sớm gây ảnh hưởng sâu rộng lên nền văn học nhân loại và truyền cảm hứng cho nhiều nhà văn nổi tiếng thế giới, như lời nhận xét của nhà văn Maxin Gorki: “Công trình dệt gấm bằng từ ngữ này xuất hiện từ thời tối cổ, những sợi tơ muôn màu của nó lan khắp bốn phương, phủ lên Trái Đất một tấm thảm từ ngữ đẹp lạ lùng”.','TCT',1,'101','101-1'),(212,'Truyện Cổ Andersen Toàn Tập - Tập 1','NXB Văn Học',2021,'Tiếng Việt','','TCT',1,'101','101-1'),(213,'Truyện Cổ Andersen Toàn Tập - Tập 2','NXB Văn Học',2021,'Tiếng Việt','','TCT',1,'101','101-1'),(214,'Thần Thoại Bắc Âu','NXB Văn Học',2021,'Tiếng Việt','Cuốn sách với tựa đề Thần thoại Bắc Âu, xuất hiện đầu tiên vào năm 1840, ban đầu được viết với mục đích làm sách giáo khoa phụ lục cho bộ môn lịch sử Na Uy, Thụy Điển và Đan Mạch. Vì là sách dành cho học sinh và mang tính chất tham khảo, tác phẩm này đã trở nên vô cùng phổ biến. Ấn bản thứ 3 (xuất bản năm 1992) - cũng là bản gốc của bản dịch này - được biên tập bởi giáo sư Magnus Olsen đến từ trường đại học Oslo, mang đến một cái nhìn mới cho cuốn sách này.','TCT',1,'101','101-1'),(215,'Thần Thoại Hy Lạp (Tái Bản)','NXB Văn Học',2021,'Tiếng Việt','Thần thoại Hy Lạp là những câu chuyện lý giải sự hình thành thế giới nhưng lấp lánh bên trong đó là khát khao, là ước mơ khẳng định tầm vóc của con người trước thiên nhiên. Những ước mơ ấy của loài người càng lấp lánh bao nhiêu thì bầu trời đêm thần thoại lại càng huyền bí, càng rộng mở bấy nhiêu.','TCT',1,'101','101-1'),(216,'Cổ Tích Việt Nam','NXB Văn Học',2021,'Tiếng Việt','Truyện cổ tích luôn đóng một vai trò quan trọng đối với sự hình thành và phát triển nhân cách của trẻ. Những câu chuyện mang đậm giá trị nhân đạo, có ý nghĩa giáo dục sâu sắc giúp các em trưởng thành, phát triển tư duy một cách lành mạnh và trong sáng nhất. Không những thế, lời văn đẹp đẽ trong các câu chuyện cổ còn có tác dụng bồi dưỡng cho trẻ năng lực thẩm mỹ, khả năng cảm thụ văn học, giúp trẻ sử dụng ngôn ngữ một cách phong phú và hiệu quả.','TCT',1,'101','101-1'),(217,'Giấc Mơ Tuổi Thơ','NXB Mỹ Thuật',2021,'Tiếng Việt','Từ xưa đến nay, những câu chuyện cổ tích đã đi sâu vào tiềm thức tuổi thơ mỗi người. Trong lời ru của mẹ, lời kể của bà đều thấp thoáng bóng dáng của những ông bụt bà tiên; những cô cậu bé hiếu thảo; những tấm lòng cao thượng, mang đậm giá trị nhân văôi dưỡng tâm hồn trẻ thơ, vun đắp cảm xúc và lòng nhân ái của trẻ sau này. Giấc mơ tuổi thơ với những nét vẽ hồn nhiên, trong trẻo, ngôn từ ngắn gọn súc tích sẽ mang đến cho các em những giấc mơ thực sự ngọt ngào.','TCT',1,'101','101-1'),(218,'Thạch Sanh','NXB Mỹ Thuật',2021,'Tiếng Việt','','TCT',1,'101','101-1'),(219,'Cổ Tích Trăng Non','NXB Mỹ Thuật',2021,'Tiếng Việt','','TCT',1,'101','101-1'),(220,'Rùa Và Thỏ Chạy Thi','NXB Mỹ Thuật',2021,'Tiếng Việt','','TCT',1,'101','101-1'),(221,'Ngữ Văn 11 - Tập 1','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(222,'Ngữ Văn 11 - Tập 2','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(223,'Lịch Sử 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(224,'Giải tích 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(225,'Hình học 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(226,'Giáo dục công dân 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(227,'Hóa Học 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(228,'Sinh học 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(229,'Tin học 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(230,'Tiếng Anh 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(231,'Địa lí 11','NXB Giáo Dục Việt Nam',2021,'Tiếng Việt','','SGKC3',2,'201','201-2'),(232,'Đại Việt Sử Ký Toàn Thư Trọn Bộ','NXB Hồng Đức',2020,'Tiếng Việt','Trong các sách lịch sử cũ của ta , thì \" Đại Việt sử ký toàn thư \" là một bộ sử lớn chép từ Hồng Bàng đến Ất Mão ( 1675) đời vua Gia Tôn nhà Lê. \" Đại Việt sử ký toàn thư \" là bộ sách lịch sử quý báu trong tủ sách sử cũ của nước Việt Nam , rất cần thiết cho những người nghiên cứu lịch sử dân tộc ','LSVN',2,'201','201-1'),(233,'Việt Sử Yếu','NXB Hồng Đức',2020,'Tiếng Việt','Được hoàn thiện bằng chữ Hán năm 1914, rồi được chính tác giả chuyển soạn sang chữ quốc ngữ và đăng trên Đông Dương tạp chí năm 1915, VIỆT SỬ YẾU của Hoàng Cao Khải có thể xem là cuốn sách quốc ngữ đầu tiên mở ra lối viết hiện đại về lịch sử Việt Nam. Học tập cách viết sử từ phương Tây, sách tạo nên một bứt phá đáng kể trong cách tiếp cận và biên soạn lịch sử, khác hẳn lối chép sử biên niên truyền thống của các sử gia phong kiến.','LSVN',2,'201','201-1'),(234,'VIỆT NAM VĂN HOÁ SỬ CƯƠNG (Bìa da)','NXB Thế Giới',2020,'Tiếng Việt','','LSVN',2,'201','201-1'),(235,'Đế Quốc An Nam Và Người Dân An Nam','NXB Thế Giới',2020,'Tiếng Việt','','LSVN',2,'201','201-1'),(236,'Nam Phương - Hoàng Hậu Cuối Cùng (Tái Bản 2020)','NXB Thế Giới',2020,'Tiếng Việt','Nam Phương - Hoàng hậu cuối cùng là cuốn sách tập hợp những câu chuyện về Hoàng hậu Nam Phương, người con gái tài sắc vẹn toàn của đất Gò Công - Tiền Giang, người đã chinh phục hoàn toàn trái tim của Hoàng đế Bảo Đại để bước lên ngôi Hoàng hậu của triều Nguyễn vào năm 1934.','LSVN',2,'201','201-1'),(237,'Hoàng Lê Nhất Thống Chí (Bìa Mềm)','NXB Dân Trí',2021,'Tiếng Việt','Đây là cuốn tiểu thuyết lịch sử ghi chép về sự thống nhất vương triều nhà Lê vào thời điểm Tây Sơn diệt trịnh , trả lại Bắc Hà cho vua Lê đến khi Nguyễn Ánh đánh bại Tây Sơn , thống nhất cả nước.','LSVN',2,'201','201-1'),(238,'Cách Mạng Ruộng Đất Ở Việt Nam','NXB Khoa Học Xã Hội',2021,'Tiếng Việt','Đến hết thế kỷ XX, có thể nói, xã hội Việt Nam vẫn là một xã hội chịu sự chi phối của ba yếu tố nông thôn - nông nghiệp - nông dân. Chế độ ruộng đất là một vấn đề “hằng xuyên” trong lịch sử Việt Nam. Mọi biến động về chế độ ruộng đất đều ảnh hưởng lớn đến cấu trúc và sự phát triển của xã hội. Vì vậy, đây là mảng đề tài luôn được các nhà Sử học, Kinh tế học Việt Nam quan tâm nghiên cứu.','LSVN',2,'201','201-1'),(239,'Những Người Châu Âu Ở Nước An Nam','NXB Thế Giới',2019,'Tiếng Việt','Tác phẩm Những người Châu Âu ở nước An Nam gồm hai chuyên luận Những người Châu Âu ở nước An Nam và Thương Điếm Anh ở Đàng ngoài, Ch. B Maybon đã dựng lên một toàn cảnh về sự có mặt và hoạt động của các giáo sĩ và thương nhân phương Tây ở An Nam trong hai thế kỷ XVII và XVIII.','LSVN',2,'201','201-1'),(240,'Khởi Nghĩa Lam Sơn (1418 - 1427)','NXB Dân Trí',2019,'Tiếng Việt','Khởi nghĩa Lam Sơn (1418–1427) là cuộc khởi nghĩa đánh đuổi quân Minh xâm lược về nước do Bình Định vương Lê Lợi (tức Hoàng đế Lê Thái Tổ) lãnh đạo và kết thúc bằng việc giành lại độc lập cho nước Đại Việt cùng với sự thành lập nhà Hậu Lê.','LSVN',2,'201','201-1'),(241,'Những Bài Dã Sử Việt (Bìa Cứng)','NXB Tri Thức',2021,'Tiếng Việt','Những đồng nghiệp trong giới sử học và những người quan tâm đến lịch sử nước nhà đều biết đến những công trình chuyên khảo về lịch sử và văn hóa của Tạ Chí Đại Trường như: Lịch sử nội chiến ở Việt Nam từ 1771 đến 1802; Thần, người và đất Việt; Việt Nam nhìn từ bên trong và bên ngoài; Những bài văn sử; Sử Việt đọc vài quyể Ông đã tham gia vào lĩnh vực này từ lâu, ông viết sử trong nhiều hoàn cảnh xã hội và hoàn cảnh sống khác nhau, trước và sau năm 1975 ở miền Nam, ở trong nước và hải ngoại sau năm 1975.','LSVN',2,'201','201-1'),(242,'Các Thương Cảng Ven Biển Bắc Trung Bộ Thế kỷ X - XIX','NXB Thế Giới',2021,'Tiếng Việt','Cuốn sách “Các thương cảng ven biển Bắc Trung Bộ thế kỷ X - XIX” của tác giả Nguyễn Văn Chuyên được phát triển từ luận án Tiến sĩ Sử học của chính tác giả, bảo vệ tại Trường Đại học Khoa học Xã hội và Nhân văn, Đại học Quốc gia Hà Nội vào năm 2018. Luận án có tầm cỡ một công trình nghiên cứu chuyên sâu không chỉ có ý nghĩa khoa học mà còn thiết thực đóng góp vào công cuộc nghiên cứu phục vụ sự nghiệp phát triển kinh tế - xã hội và an ninh vùng Bắc Trung Bộ của Tổ quốc.','LSVN',2,'201','201-1'),(243,'Lịch Sử Hà Nội (Bìa Cứng)','NXB Thế Giới',2021,'Tiếng Việt','Đền chùa, cung điện, biệt thự thời Pháp và những công trình kiến trúc Liên Xô, lịch sử Hà Nội từ xưa đến nay, từ vinh quang đến đau khổ, luôn diễn ra giữa hai thế giới Á, Âu. Sau một thời gian dài dưới chế độ Bắc thuộc, năm 1010, Thăng Long đã vươn mình bay lên. Trong các thế kỷ sau đó, qua những triều đại nối tiếp nhau, Thăng Long đã thực sự trở thành một kinh đô phát triển rực rỡ vào thế kỷ thứ XV, dưới thời Lê, đánh dấu đỉnh cao của Nhà nước Nho giáo. Trí thức và quan lại tấp nập ra vào trong triều, chi tiêu, mua sắm làm giàu cho khu thị dân, trong khi tiếng tăm của các viện sĩ thuộc Hàn lâm Viện lan rộng tới cả ngoại bang. Mặc dù luôn có những biến cố trong hoàng cung, kinh đô của Bắc Kỳ đã khắc sâu trong tâm tưởng của những lữ khách phương Tây bỏ neo bên bờ sông Hồng vào thế kỷ XVII. Rồi Hà Nội là thành phố của “ba sáu phố phường”, của những người buôn bán và thợ thủ công với những phố Hàng Đào, Hàng Bạc, Hàng Trống, Hàng Giầy. Thành phố đánh mất vai trò thủ đô vào đầu thế kỷ XIX để rồi, trớ trêu thay, lại trở thành thủ đô dưới thời Pháp thuộc. Trong hơn nửa thế kỷ, Hà Nội là thủ phủ của toàn cõi Đông Dương. Giai đoạn này đã để lại cho Hà Nội những công trình hoành tráng, những biệt thự xinh đẹp giờ đây trở thành di sản của thành phố bên cạnh các làng, các phường, cùng đền chùa và Văn Miếu.','LSVN',2,'201','201-1'),(244,'Mật Bổn - Những Bí Ẩn Lịch Sử Việt Nam Cổ Trung Đại','NXB Tổng hợp TP.HCM',2021,'Tiếng Việt','','LSVN',2,'201','201-1'),(245,'Ý Thức Về Chủ Quyền Và Lợi Ích Quốc Gia Của Một Số Nhà Cải Cách Ở Khu Vực Đông Á Nửa Cuối Thế Kỷ XIX - Đầu Thế Kỷ XX','NXB Khoa Học Xã Hội',2020,'Tiếng Việt','Cuốn sách với tên gọi khá dài: “Ý thức về chủ quyền và lợi ích quốc gia của một số nhà cải cách ở khu vực Đông Á nửa cuối thế kỷ XIX - đầu thế kỷ XX” là công trình được xuất bản trên cơ sở hiệu chỉnh và phát triển từ Luận án Tiến sĩ của nhà nghiên cứu Nguyễn Tiến Dũng với chủ đề chính bàn về vấn đề quyền lợi quốc gia trong tư tưởng của một số nhà cải cách Đông Á thời cận đại là Fukuzawa Yukichi (Nhật Bản), Mongkut (Siam - Thái Lan), Lý Hồng Chương (Trung Quốc) và Nguyễn Trường Tộ (Việt Nam).','LSVN',2,'201','201-1'),(246,'Ức Trai Di Tập Dư Địa Chí','NXB Đại Học Quốc GIa Hà Nội',2019,'Tiếng Việt','Chúng ta đã biết Nguyễn Trãi qua Bình Ngô đại cáo, qua Quốc âm thi tập và một số di cảo văn thơ khác. Chúng ta nên biết đến thêm một đóng góp khá quan trọng về địa lý của ông là sách Dư địa chí. Nếu Quốc âm thi tập là tác phẩm văn học chữ Nôm đầy đủ, xưa nhất còn đến ngày nay, có thể làm cột mốc quan trọng trong lịch sử văn học thì Dư địa chí cũng là một tác phẩm địa lý Việt Nam xưa nhất, một tài liệu quý giá cho khoa học địa lý lịch sử.','LSVN',2,'201','201-1'),(247,'54 Vị Hoàng Đế Việt Nam (2019)','NXB Hồng Đức',2019,'Tiếng Việt','Cuốn sách “54 vị Hoàng đế Việt Nam” giới thiệu chân dung của 54 vị hoàng đế tiêu biểu trong số gần một trăm vị hoàng đế từ nhà Tiền Lý (Lý Nam Đế) đến nhà Nguyễn với vị vua cuối cùng là Bảo Đại. Cuốn sách cung cấp cho bạn đọc những tư liệu ngắn gọn, dễ đọc, dễ hiểu được chắt lọc từ nhiều nguồn tư liệu khác nhau. Mặc dù chỉ giới thiệu chân dung của 54 vị hoàng đế, nhưng trong từng triều đại, cuốn sách còn cung cấp thông tin về các vị vua khác của triều đại đó, kể cả 11 đời chúa Trịnh và 9 đời chúa Nguyễn, đây chỉ là tiêu chí lựa chọn riêng của tác giả, do vậy nó chỉ mang tính tương đối.','LSVN',2,'201','201-1'),(248,'54 Vị Hoàng Hậu Việt Nam (2019)','NXB Hồng Đức',2019,'Tiếng Việt','Cuốn sách “54 vị Hoàng hậu Việt Nam” giới thiệu khái quát chân dung của 54 vị hoàng hậu tiêu biểu trong số hàng trăm vị hoàng hậu từ nhà Tiền Lý (Lý Nam Đế) với Hoàng hậu Đỗ Thị Khương đến nhà Nguyễn với vị hoàng hậu cuối cùng là Nam Phương, vợ vua Bảo Đại. Cuốn sách cung cấp cho bạn đọc những tư liệu ngắn gọn được sắp xếp khoa học, dễ hiểu, dễ đọc, dễ nhớ được chắt lọc từ nhiều nguồn tư liệu khác nhau. Tuy giới thiệu về các vị hoàng hậu, nhưng cuốn sách đã điểm qua về bối cảnh lịch sử của triều đại mà vua chúa và hoàng hậu đã sống cũng như những cống hiến, công lao và cả những mặt hạn chế của họ, cung cấp một số chuyện tình, hôn nhân, vợ con của các vị vua chúa. Thông qua đó, nhiều câu chuyện tình “thâm cung bí sử” được tái hiện một cách khách quan, sinh động, vừa mang tính chất khảo cứu vừa mang tính chất gợi mở, cung cấp thông tin để chúng ta có thể tiếp tục tìm hiểu về các vương triều xưa mặc dù đã bị nhiều lớp bụi của thời gian che phủ. Đây chỉ là sự lựa chọn theo tiêu chí riêng của tác giả cuốn sách.','LSVN',2,'201','201-1'),(249,'Xứ Đàng Trong','NXB Thế Giới',2019,'Tiếng Việt','“Cristoforo Borri là người đầu tiên đã mô tả đất nước An Nam, sản vật, con người, chính thể, tín ngưỡng, tập quán của xứ này. Và ông đã mô tả mọi thứ rất tuyệt vời. Ông chỉ sống 5 năm ở các vùng lân cận Đà Nẵng hoặc trong phủ Quy Nhơn. Nhưng chừng đó thời gian đã đủ để ông nắm bắt một cách chuẩn xác và gần như trọn vẹn. Ông may mắn biết ngôn ngữ xứ này, là một việc rất hiếm hoi thời đó: ông chắc hẳn là người Âu châu thứ hai đã chuyên tâm nghiên cứu tiếng An Nam. Nhưng chuyện đó cũng không đủ giải thích thỏa đáng cho cái ích lợi mà cuốn ký sự Xứ Đàng Trong của ông đem tới. Cristoforo Borri là một người ham hiểu biết. Ông đã thực hiện một cuộc điều tra nghiêm túc về thế giới xung quanh ông, và, nếu ngày nay, ta gặp phải khó khăn khi muốn xác nhận một vấn đề nào đó thì hãy so sánh với thời Cristoforo Borri để thấy giá trị của sự bền bỉ, sự minh mẫn của giáo sĩ này – người đã biết thiết lập những ý niệm sáng tỏ và chuẩn xác cho những thứ hoàn toàn mới lạ với dân Âu châu.','LSVN',2,'201','201-1'),(250,'Khai Nguyên Rồng Tiên','NXB Hội Nhà Văn',2021,'Tiếng Việt','Truyền thuyết “Lạc Long Quân và Âu Cơ” hay “Con Rồng cháu Tiên” lần đầu tiên được đưa vào chính sử nước ta vào năm 1479 đời vua Thánh tông nhà Hậu Lê. Đó chính là bộ sử Đại Việt sử ký toàn thư do sử thần Ngô Sĩ Liên theo lệnh vua mà chép. Trước đó nửa thế kỷ, vua Lê Lợi khởi nghĩa ở Thanh Hóa, đập tan ách đô hộ của giặc Minh, lập nên triều đại nhà Lê - một triều đình được thiết lập từ các mối quan hệ phức tạp giữa các tập đoàn dân thiểu số (tập đoàn Thái-Mường) và các thế lực Kinh Lộ.','LSVN',2,'201','201-1'),(251,'Sapiens: Lược Sử Loài Người (Tái Bản 2021)','NXB Thế Giới',2021,'Tiếng Việt','Trong ấn bản mới này của cuốn Sapiens - Lược sử loài người, chúng tôi đã có một số hiệu chỉnh về nội dung với sự tham gia, đóng góp của các thành viên Cộng đồng đọc sách Tinh hoa. Xin trân trọng cảm ơn ý kiến đóng góp tận tâm của các quý độc giả, đặc biệt là ông Nguyễn Hoàng Giang, ông Nguyễn Việt Long, ông Đặng Trọng Hiếu cùng những người khác. Mong tiếp tục nhận được sự quan tâm và góp ý từ độc giả.','LSTG',2,'201','201-1'),(252,'Homo Deus: Lược Sử Tương Lai','NXB Thế Giới',2020,'Tiếng Việt','Homo sapiens có phải là một dạng sống siêu đẳng, hay chỉ là một tay đầu gấu địa phương? Làm thế nào con người lại tin rằng họ không chỉ đã kiểm soát thế giới, mà còn mang lại ý nghĩa cho nó? Công nghệ sinh học và trí thông minh nhân tạo đe doạ loài người ra sao? Sinh vật nào có thể kế thừa loài người, và tôn giáo mới nào sẽ được sản sinh?','LSTG',2,'201','201-1'),(253,'Lược Sử Thế Giới','NXB Thế Giới',2019,'Tiếng Việt','Như một bài thơ về lịch sử thế giới, E. H. Gombrich lịch lãm dẫn người đọc đi từ thời kỳ Đồ đá đến thời kỳ của năng lượng nguyên tử, với những biến cố lịch sử phức tạp nhất, các trào lưu tư tưởng khó hiểu nhất, những nhân vật lịch sử đa chiều nhất, các thành tựu lớn lao nhất của trí tuệ con người… tất cả đều được tác giả mô tả và diễn giải dễ hiểu đến bất ngờ.','LSTG',2,'201','201-1'),(254,'Súng, Vi Trùng Và Thép: Định Mệnh Của Các Xã Hội Loài Người','NXB Thế Giới',2019,'Tiếng Việt','Mục đích của cuốn sách này là cung cấp một lược sử về tất cả mọi người trong khoảng 13.000 năm trở lại đây. Câu hỏi đã khiến tôi viết ra cuốn sách này là: tại sao lịch sử đã diễn ra trên mỗi châu lục một khác?','LSTG',2,'201','201-1'),(255,'Leonardo Da Vinci','NXB Thế Giới',2019,'Tiếng Việt','','LSTG',2,'201','201-1'),(256,'Hán Sở Diễn Nghĩa','NXB Thế Giới',2019,'Tiếng Việt','Hán Sở diễn nghĩa (tên gốc Tây Hán diễn nghĩa) là trước tác của Chung Sơn cư sỹ Chân Vĩ, vốn quen thuộc với độc giả Việt Nam qua cái tên Hán Sở tranh hùng. Lần này, qua bản dịch mới mẻ và đầy đủ 101 hồi của dịch giả Châu Hải Đường, một lần nữa quá khứ bi hùng về cuộc chiến giữa Lưu Bang và Hạng Vũ cách đây hơn hai nghìn năm lại như sống dậy trước mắt độc giả. Qua ngòi bút kiệt xuất của tác giả, ta thấy cái tài của người làm tướng quyết thắng ngoài nghìn dặm, cái trung của kẻ làm tôi hy sinh cứu chúa, cái dũng của tướng sỹ công thành hạ địch, cái mưu của kẻ sỹ quy phục chư hầu. Hòa mình vào Hán Sở diễn nghĩa, ta còn khắc khoải với những thành bại được mất tự nghìn xưa, hào hứng theo giấc mộng đồ vương định bá, và cũng xót xa cho thân phận chinh nhân trong những trận chiến một mất một còn. Bi và hùng đan xen hoà lẫn, Hán Sở diễn nghĩa đã tạo nên một thiên anh hùng ca rất riêng.','LSTG',2,'201','201-1'),(257,'Lịch Sử Do Thái','NXB Thế Giới',2020,'Tiếng Việt','Lịch sử Do Thái của Paul Johnson bắt đầu bằng những sự kiện được viết trong Kinh Thánh và kết thúc khi thành lập Nhà nước Israel. Cuốn sách không chỉ giới thiệu về lịch sử 4.000 năm tồn tại của người Do Thái mà còn đề cập đến những tác động, ảnh hưởng cũng như những đóng góp của họ cho nhân loại.','LSTG',2,'201','201-1'),(258,'Biến Động','NXB Thế Giới',2020,'Tiếng Việt','Trong tác phẩm mới nhất vừa ra mắt năm 2019 – Biến động, Jared Diamond kể cho chúng ta câu chuyện các quốc gia đã vượt qua những biến cố lớn và hồi phục thành công như thế nào.','LSTG',2,'201','201-1'),(259,'45 Đời Tổng Thống Hoa Kỳ (Bìa Cứng)','NXB Thế Giới',2020,'Tiếng Việt','45 đời tổng thống Hoa Kỳ là một bộ cẩm nang đồ sộ dày hơn 1500 trang, tái hiện toàn bộ lịch sử nước Mỹ. Mỗi tổng thống, một tính cách, một bối cảnh lịch sử, rất nhiều những câu chuyện và bí ẩn xoay quanh, mà không có bất cứ một kênh truyền thông nào tổng hợp chi tiết và đặc sắc bằng tác giả William A. Degregorio - nhà nghiên cứu chính trị Hoa Kỳ, người say mê tìm hiểu về cuộc đời các Tổng thống Mỹ từ khi còn nhỏ.','LSTG',2,'201','201-1'),(260,'Sử Ký Tư Mã Thiên','NXB Thế Giới',2020,'Tiếng Việt','Đối với văn hóa thế giới, quyển Sử ký Tư Mã Thiên chiếm một địa vị đặc biệt. Nó là một công trình sử học lớn nhất của Trung Quốc và là một trong những quyển sử có tiếng nhất của thế giới.','LSTG',2,'201','201-1'),(261,'12 Hoàng Đế La Mã','NXB Thế Giới',2020,'Tiếng Việt','Cuốn sách 12 hoàng đế La Mã của Caius Suetonius Tranquillus đủ làm thỏa mãn sự hiếu kỳ tự nhiên này. Trong những trang viết, chúng ta sẽ thấy một loạt những bức chân dung cá nhân – về tư cách và sở thích của các vị hoàng đế được phác họa một cách sinh động gần gũi, hoàn toàn chân thực và tuyệt đối không thiên vị.','LSTG',2,'201','201-1'),(262,'Thiên Hoàng Minh Trị ( Bìa Cứng )','NXB Thế Giới',2019,'Tiếng Việt','Triều đại Minh Trị là giai đoạn khai sinh ra nước Nhật mới, chuyển từ quốc gia phong kiến lạc hậu sang một xã hội công nghiệp lập hiến hiện đại, tạo nên một cuộc duy tân thần kì mà cho đến nay vẫn là mô hình châu Á lôi cuốn. Mô tả từ bên trong công cuộc khai sinh này với những nhân vật lịch sử liên quan, tác phẩm Thiên hoàng Minh Trị sẽ dắt chúng ta đi qua những giai đoạn cuộc đời của vị hoàng đế này, từ những năm tháng ấu thơ được giáo dục theo truyền thống đến khi thiết triều giải quyết chính sự, từ cuộc hôn nhân với hoàng hậu đến mối quan hệ với các trắc thất, từ ảnh hưởng của tư tưởng Nho giáo cho đến lúc khoác lên mình bộ quân phục châu Â','LSTG',2,'201','201-1'),(263,'Danh Tướng - Các Nhà Cầm Quân Vĩ Đại Nhất Trong Lịch Sử','NXB Thế Giới',2019,'Tiếng Việt','Danh Tướng - Các Nhà Cầm Quân Vĩ Đại Nhất Trong Lịch Sử đưa ra cái nhìn mới về giới lãnh đạo quân sự, những người đã làm nên lịch sử bằng những trận chiến trên bộ, trên biển, cũng như trên không, từ Alexander Đại Đế, nhà chinh phạt lẫy lừng của thế kỉ 4 TCN, tới chư tướng dẫn dắt các chiến dịch ở Afghanistan và Iraq ngày nay.','LSTG',2,'201','201-1'),(264,'Đệ Nhất Thế Chiến','NXB Thế Giới',2019,'Tiếng Việt','Ngày 28 tháng 6 năm 1914, Đệ nhất Thế chiến bùng nổ bằng hai phát súng lục. Nạn nhân của vụ ám sát là Hoàng tử nước Áo, Francis Ferdinand, và vợ ông, Sophie. Một bắt đầu với sự kiện tưởng chừng như đơn giản vì nó nằm trong lãnh thổ của một đất nước nhỏ bé, nhưng cuộc chiến lại kéo dài đến bốn năm, liên quan tới hầu hết các cường quốc hùng mạnh trên thế giới, trở thành cuộc xung đột đẫm máu và hao tổn nhất trong lịch sử nhân loại.','LSTG',2,'201','201-1'),(265,'Phi Châu Thịnh Vượng - Lịch Sử 5.000 Năm Của Sự Giàu Có, Tham Vọng Và Nỗ Lực','NXB Thế Giới',2019,'Tiếng Việt','Châu Phi thực sự là lục địa đa dạng, sở hữu đủ loại hình phong cảnh và văn hóa. Khoảng 1.500 ngôn ngữ được sử dụng.Những mối nguy mà nó mang lại cũng đa dạng như vậy. Phần lớn châu Phi chịu ảnh hưởng của khí hậu khắc nghiệt và biến động, lượng mưa không ổn định, hạn hán thường xuyên, địa hình trắc trở, đất đai nghèo nàn và rất nhiều bệnh tật cho cả con người lẫn động vật. Thế nhưng, điều khiến châu lục này nổi bật chính là tài nguyên thiên nhiên phong phú được tìm thấy nơi đây (vàng, ngà voi, dầu mỏ, các mỏ khoáng sản quý…). Chính nguồn tài nguyên dồi dào này đã đóng vai trò quan trọng trong việc định hình sự giàu có của châu Phi suốt 5.000 năm qua.','LSTG',2,'201','201-1'),(266,'Khoa Học Về Nấu Ăn - The Sciene of Cooking','NXB Thế Giới',2021,'Tiếng Việt','Nắm bắt các kiến thức khoa học và nấu ăn như một đầu bếp thực thụ!\n','SNA',1,'101','101-3'),(267,'Bố Già (Bìa Cứng) (Tái Bản)','NXB Văn Học',2021,'Tiếng Việt','Thế giới ngầm được phản ánh trong tiểu thuyết Bố Già là sự gặp gỡ...','TPKD',1,'102','102-3'),(268,'Thư Viện Nửa Đêm','NXB Hội Nhà Văn',2021,'Tiếng Việt','“Hấp dẫn mà dễ chịu… cái nhìn về khả năng vô tận, về bước chân lên những con đường mới, về sống những cuộc đời mới, về một thế giới hoàn toàn khác để chúng ta tiếp cận theo một cách nào đó, ở một nơi nào đó, có thể chính là thứ ta cần trong thời điểm gian nan và hỗn loạn như bây giờ.” ','TGTHBPL',1,'102','102-2'),(269,'Xứ Cát','NXB Hội Nhà Văn',2021,'Tiếng Việt','Một thời điểm rất xa trong tương lai…','TGTHBPL',1,'102','102-2'),(270,'Blockchain: Bản Chất Của Blockchain, Bitcoin, Tiền Điện Tử, Hợp Đồng Thông Minh Và Tương Lai Của Tiền Tệ','NXB Lao Động',2017,'Tiếng Việt','Tiền điện tử, với đại diện tiêu biểu nhất là Bitcoin, đang là mối quan tâm hàng đầu của giới tài chính toàn cầu','STCTT',3,'301','301-4'),(271,'Những Vị Thần Nước Mĩ','NXB Phụ Nữ Việt Nam',2021,'Tiếng Việt','“Những vị thần nước Mỹ đã thành công trong việc tái sáng tạo, cũng như khẳng định tầm quan trọng lâu dài của văn chương kỳ ảo trong thời đại ngày nay.”','TGTHBPL',1,'102','102-2'),(272,'Harry Potter và Hòn Đá Phù Thủy (Tập 1)','NXB Trẻ',2016,'Tiếng Việt','Khi một lá thư được gởi đến cho cậu bé Harry Potter bình thường và bất hạnh, cậu khám phá ra một bí mật đã được che giấu suốt cả một thập kỉ.','TGTHBPL',1,'102','102-2'),(273,'Harry Potter và Phòng Chứa Bí Mật (Tập 2)','NXB Trẻ',2016,'Tiếng Việt','Harry khổ sở mong ngóng cho kì nghỉ hè kinh khủng với gia đình Dursley kết thúc. Nhưng một con gia tinh bé nhỏ tội nghiệp đã cảnh báo cho Harry biết về mối nguy hiểm chết người đang chờ cậu ở trường Hogwarts.','TGTHBPL',1,'102','102-2'),(274,'Harry Potter và Tên Tù Nhân Ngục Azkaban (Tập 3)','NXB Trẻ',2016,'Tiếng Việt','Harry Potter may mắn sống sót đến tuổi 13, sau nhiều cuộc tấn công của Chúa tể hắc ám.Nhưng hy vọng có một học kỳ yên ổn với Quidditch của cậu đã tiêu tan thành mây khói khi một kẻ điên cuồng giết người hàng loạt vừa thoát khỏi nhà tù Azkaban, với sự lùng sục của những cai tù là giám ngục.','TGTHBPL',1,'102','102-2'),(275,'Harry Potter và Chiếc Cốc Lửa (Tập 4)','NXB Trẻ',2016,'Tiếng Việt','Khi giải Quidditch Thế giới bị cắt ngang bởi những kẻ ủng hộ Chúa tể Voldemort và sự trở lại của Dấu hiệu hắc ám khủng khiếp, Harry ý thức được rõ ràng rằng, Chúa tể Voldemort đang ngày càng mạnh hơn.','TGTHBPL',1,'102','102-2'),(276,'Harry Potter và Hội Phượng Hoàng (Tập 5)','NXB Trẻ',2016,'Tiếng Việt','Harry tức giận vì bị bỏ rơi ở nhà Dursley trong dịp hè, cậu ngờ rằng Chúa tể hắc ám Voldemort đang tập hợp lực lượng, và vì cậu có nguy cơ bị tấn công, những người Harry luôn coi là bạn đang cố che giấu tung tích cậu. Cuối cùng, sau khi được giải cứu, Harry khám phá ra rằng giáo sư Dumbledore đang tập hợp lại Hội Phượng Hoàng – một đoàn quân bí mật đã được thành lập từ những năm trước nhằm chống lại Chúa tể Voldemort.','TGTHBPL',1,'102','102-2'),(277,'Harry Potter và Hoàng Tử Lai (Tập 6)','NXB Trẻ',2016,'Tiếng Việt','Đây là năm thứ 6 của Harry Potter tại trường Hogwarts. Trong lúc những thế lực hắc ám của Voldemort gieo rắc nỗi kinh hoàng và sợ hãi ở khắp nơi, mọi chuyện càng lúc càng trở nên rõ ràng hơn đối với Harry, rằng cậu sẽ sớm phải đối diện với định mệnh của mình. Nhưng liệu Harry đã sẵn sàng vượt qua những thử thách đang chờ đợi phía trước?','TGTHBPL',1,'102','102-2'),(278,'Harry Poter và Bảo Bối Tử Thàn (Tập 7-Phần 1)','NXB Trẻ',2016,'Tiếng Việt','Harry đang chờ đợi ở trường Privet Drive. Hội Phượng Hoàng sắp đến hộ tống nó ra đi an toàn, gắng hết sức không để cho Voldemort và bọn tay chân hắn biết được. Nhưng sau đó Harry sẽ làm gì? Làm cách nào nó có thể hoàn thành nhiệm vụ cực kỳ quan trọng và dường như bất khả thi mà giáo sự Dumbledore đã giao lại cho nó?','TGTHBPL',1,'102','102-2'),(279,'Harry Poter và Bảo Bối Tử Thàn (Tập 7-Phần 2)','NXB Trẻ',2016,'Tiếng Việt','Harry đang chờ đợi ở trường Privet Drive. Hội Phượng Hoàng sắp đến hộ tống nó ra đi an toàn, gắng hết sức không để cho Voldemort và bọn tay chân hắn biết được. Nhưng sau đó Harry sẽ làm gì? Làm cách nào nó có thể hoàn thành nhiệm vụ cực kỳ quan trọng và dường như bất khả thi mà giáo sự Dumbledore đã giao lại cho nó?','TGTHBPL',1,'102','102-2'),(280,'Harry Potter và Đứa Trẻ Bị Nguyền Rủa','NXB Trẻ',2016,'Tiếng Việt','Từ những nhân vật quen thuộc trong bộ Harry Potter, kịch bản nói về cuộc phiêu lưu của những hậu duệ, sự can thiệp vào dòng thời gian đã gây ra những thay đổi không ngờ cho tương lai tưởng chừng đã yên ổn sau khi vắng bóng chúa tể Voldermort','TGTHBPL',1,'102','102-2'),(281,'Luật Mới Trong Giới Thời Trang - Và Cách Kỷ Nguyên 4.0 Đã Thay Đổi Hoàn Toàn Ngành Công Nghiệp Này','NXB Thế Giới',2020,'Tiếng Việt','Ai sẽ là người quyết định chúng ta mặc gì, mặc như thế nào và làm sao để khiến cá tính của bản thân được bộc lộ thông qua bộ trang phục ấy ? Có phải chính là chúng ta không ? Chúng ta đang tự quyết định phong cách và thương hiệu cá nhân của mình ư ? Hay chính những khán giả của chúng ta, một người tình cờ ngang qua trên phố, một người đứng ngay trước mặt khi chúng ta đang xếp hàng chờ mua cà phê, hay một người vừa mới bấm theo dõi ta trên Instagram mới là người có quyền quyết định ?','MTTT',1,'101','101-3'),(282,'Đừng Chỉ Mặc Màu Đen','NXB Thế Giới',2020,'Tiếng Việt','ĐỪNG CHỈ MẶC MÀU ĐEN là cuốn sách thời trang được viết nên bởi Giám đốc chuyên mục Thời trang thuộc tạp chí The Times (Anh Quốc) – Anna Murphy. Anna viết nên cuốn sách này chỉ nhằm một mục đích duy nhất, cung cấp cho người phụ nữ một nguồn tài liệu tham khảo từ cơ bản đến nâng cao, nhằm đưa họ dấn thân vào hành trình nâng cấp bản thân thành một phiên bản tinh tế, thú vị và mang đậm dấu ấn cá nhân.','MTTT',1,'101','101-3'),(283,'Có Phong Cách Riêng','NXB Thế Giới',2020,'Tiếng Việt','Nếu bạn nghĩ, thời trang là xa xỉ và sang chảnh, hẳn sẽ phải ngạc nhiên trước những bức hình OOTD mà Đặng Trầm đăng lên facebook mỗi ngày. Một phong cách chẳng xa xôi cầu kỳ. Khi thì chiếc quần jean boyfriend bụi đời, đi cùng giày cao gót đỏ, và chiếc áo sơ mi cài nút lệch hững hờ. Khi thì một bộ đầm hết sức bình thường, tay chiếc giỏ mây như giỏ người ta lùa cá bống. Chính niềm đam mê thời trang là lý do khiến Đặng Trầm sáng lập và xây dựng thành công thương hiệu sách thời trang và phong cách sống STYLORY in sâu trong lòng rất nhiều độc giả. Bên cạnh đó, việc chia sẻ các bức ảnh OOTD mỗi ngày của nữ giám đốc thương hiệu 9x đã truyền cảm hứng cho rất nhiều người phụ nữ xung quanh. Họ không phải những tín đồ thời trang sành sỏi, càng không phải những cô nàng sành điệu. Nhưng hình ảnh Đặng Trầm đăng về outfit mỗi ngày cứ thấm dần trong họ từng ngày từng ngày một. Từ đó họ chẳng thể làm ngơ với những gì mình mặc mỗi ngày. Ồ, hóa ra “phong cách thời trang” chẳng phải được hình thành từ những cái tên thương hiệu. “Phong cách thời trang” chỉ đơn giản là cách mình mặc nó mỗi ngày. Những người phụ nữ nhớ nằm lòng những lưu ý về outfit của Đặng Trầm mà trước đây thường xuyên phạm phải: hễ hở trên thì nhớ kín dưới, hở sau nhớ kín trước một chút, quần jean không nhất thiết phải đi với giày thể thao và áo thun….','MTTT',1,'101','101-3'),(284,'Cắt May Thời Trang - Các Kiểu Váy, Áo, Thời Trang Nữ','NXB Hồng Đức',2020,'Tiếng Việt','','MTTT',1,'101','101-3'),(285,'Để Mỗi Sáng Không Phải Lo Mặc Gì - 90 Cách Phối Đồ Từ 32 Trang Phục Đơn Giản Ai Cũng Có! Bí Quyết Mặc Đẹp Của Phụ Nữ Nhật Bản','NXB Kim Đồng',2019,'Tiếng Việt','','MTTT',1,'101','101-3'),(286,'Kỹ Thuật Cắt May Cơ Bản - Tập 1 (Dành Cho Người Mới Học)','NXB Bách Khoa Hà Nội',2019,'Tiếng Việt','Cuốn sách giới thiệu những mẫu cắt may cơ bản nhất, từ đó có thể giúp người học mở rộng và phát triển thành nhiều mẫu khác nhau. Với những kiến thức cơ sở và cách trình bày dễ hiểu cùng hình vẽ tỉ mỉ, cuốn sách sẽ giúp những độc giả khéo tay có thể tự thiết kế trang phục cho bản thân và các thành viên trong gia đình. Đây cũng là cuốn cẩm nang giúp các thợ may nắm bắt được những bí quyết cắt may giản tiện và hữu ích để tạo ra những sản phẩm hoàn thiện hơn.','MTTT',1,'101','101-3'),(287,'Kỹ Thuật Cắt May Cơ Bản - Tập 2 (Dành Cho Người Mới Học)','NXB Bách Khoa Hà Nội',2019,'Tiếng Việt','Cuốn sách giới thiệu những mẫu cắt may cơ bản nhất, từ đó có thể giúp người học mở rộng và phát triển thành nhiều mẫu khác nhau. Với những kiến thức cơ sở và cách trình bày dễ hiểu cùng hình vẽ tỉ mỉ, cuốn sách sẽ giúp những độc giả khéo tay có thể tự thiết kế trang phục cho bản thân và các thành viên trong gia đình. Đây cũng là cuốn cẩm nang giúp các thợ may nắm bắt được những bí quyết cắt may giản tiện và hữu ích để tạo ra những sản phẩm hoàn thiện hơn.','MTTT',1,'101','101-3'),(288,'Project 333 – Tối Giản Trong Ăn Mặc','NXB Thế Giới',2020,'Tiếng Việt','Thử thách thời trang tối giản mang tên Project 333 không phải là chuyện về thời trang hay áo xống, mà là câu chuyện về sự khởi đầu. Khi bạn nhận ra mình có thể buông bỏ được bao nhiêu muộn phiền, kiến tạo được bao nhiêu không gian, tiết kiệm được bao nhiêu tiền của, trải nghiệm được bao nhiêu niềm vui – tất cả chỉ nhờ việc cắt giảm số quần áo, phụ kiện trong tủ đồ, thì cũng là lúc bạn sẽ tự hỏi rằng tại sao mình không bắt đầu sớm hơn.','MTTT',1,'101','101-3'),(289,'Mê Đồ - Hiểu Mình ','NXB Thế Giới',2020,'Tiếng Việt','Bạn có thể cần đến chút năng khiếu để kết hợp các món đồ sao cho đẹp nhưng phong cách là thứ bạn hoàn toàn có thể học, dù bạn có ai đi chăng nữa. Mix ‒ Match là một cuộc chơi nghệ thuật không giới hạn và dáng người bạn chính là tiền đề để sáng tạo.','MTTT',1,'101','101-3'),(290,'Đan Móc Khăn Quàng Nữ','NXB Hồng Đức',2020,'Tiếng Việt','','MTTT',1,'101','101-3'),(291,'Sword Art Online - Moon Cradle 019','NXB Hồng Đức',2021,'Tiếng Việt','Moon Cradle có thể coi như ngoại truyện của arc Alicization, kể về giai đoạn đầu trong 200 năm Kirito và Asuna nằm lại Underworld. Lúc này Nhân giới và Dark Territory đã đạt đến hiệp ước hòa bình, dân Nhân giới sang Hắc giới buôn bán, dân Hắc giới sang Nhân giới du ngoạn. Tuy nhiên, còn người là còn xảy ra tranh chấp, chẳng mấy chốc Kirito phát hiện lại có một âm mưu đen tối đang nhen lên để kích động mâu thuẫn hai bên. Bởi thế cậu lên đường sang Dark Territory đàm phán với đồng minh, Ronie nằng nặc đòi đi theo, và mẩu đối thoại bên trên nảy ra khi họ cùng nghỉ chân nơi quán trọ.','LN',1,'102','102-1'),(292,'Sword Art Online - Tập 1 (Tái Bản)','NXB Hồng Đức',2021,'Tiếng Việt','Game Over đồng nghĩa với cái chết thực sự của người chơi. Không hề hay biết chân tướng này, khoảng 10.000 người đã đăng nhập MMO thế hệ mới Sword Art Online (SAO), cùng mở màn cho một cuộc tử chiến tàn khốc. Kirito, nhân vật chính, là người đầu tiên trong số game thủ SAO biết chấp nhận chân tướng ấy. Và ở hiện trường của trò chơi - một thành nổi khổng lồ mang tên Aincrad, cậu ta dần dần hiển lộ được tài năng trong vai trò game thủ solo.','LN',1,'102','102-1'),(293,'Sword Art Online - Tập 2 (Tái Bản)','NXB Hồng Đức',2021,'Tiếng Việt','Đây vẫn là game, nhưng vẫn không phải trò chơi.Tập 2 xoay quanh nhân vật chính Kirito và các cuộc gặp gỡ nhiều dấu ấn của cậu.','LN',1,'102','102-1'),(294,'Sword Art Online Progressive - 1 (Tái Bản)','NXB Hồng Đức',2021,'Tiếng Việt','Tập 001 này kể về trận công phá tầng 1 và tầng 2, có sự góp mặt của một số nhân vật vốn chỉ nghe qua tên bên series SAO như thủ lĩnh Quân Đội Kibaou, nhà buôn tin Argo Chuột Cống, rồi Agil vào thời điểm trước khi anh nổi máu thương nhân, dĩ nhiên có cả Asuna của giai đoạn mới tập chơi game online. Chỉ mỗi Kirito vẫn là Kirito mà thôi.Chương “Điệu nhạc đêm vắng sao” sẽ cho chúng ta biết lí do Kirito được gọi là Hắc kiếm sĩ.','LN',1,'102','102-1'),(295,'Sword Art Online 014 (Bản Thông Thường)','NXB Hà Nội',2019,'Tiếng Việt','Alicization, phần “Nhân giới”, kết thúc!','LN',1,'102','102-1'),(296,'Sword Art Online 011','NXB Văn học',2019,'Tiếng Việt','Yếu thế trước tinh thần chiến đấu liều mạng của Hiệp sĩ Chỉnh hợp, quân Dark Territory bắt đầu phản kháng bằng kế sách hèn hạ. Từ bên ngoài, Critter đã đưa nhiều người từ thế giới thực vào trận quyết chiến sau cùng. Số lượng tester cho một \"game VRMMO chính thống” như lời bọn họ quảng bá, đã vượt hơn 50.000 người.','LN',1,'102','102-1'),(297,'Sword Art Online 017','NXB Hà Nội',2020,'Tiếng Việt','Yếu thế trước tinh thần chiến đấu liều mạng của Hiệp sĩ Chỉnh hợp, quân Dark Territory bắt đầu phản kháng bằng kế sách hèn hạ. Từ bên ngoài, Critter đã đưa nhiều người từ thế giới thực vào trận quyết chiến sau cùng. Số lượng tester cho một \"game VRMMO chính thống” như lời bọn họ quảng bá, đã vượt hơn 50.000 người.','LN',1,'102','102-1'),(298,'Về Chuyện Tôi Chuyển Sinh Thành Slime - Tập 1','NXB Phụ Nữ Việt Nam',2020,'Tiếng Việt','Mikami Satoru – một nhân viên văn phòng bình thường - đã ba mươi bảy cái xuân xanh nhưng vẫn còn là một thanh niên trai tân chính hiệu. Một ngày nọ, vì bảo vệ đồng nghiệp của mình, anh bị một tên điên cầm dao đâm trên phố. Trong những giây phút cuối đời, khi phải lên đường sang thế giới bên kia trong tình trạng “hàng còn nguyên tem” và trong đầu anh không ngừng vang lên một giọng nói thông báo về một loạt những năng lực khó hiểu, anh đã thề rằng: Nếu được tái sinh, anh nhất định sẽ thay đổi, sẽ chủ động tán tỉnh tất cả những người mà mình gặp, nhiệt tình theo đuổi con mồi rồi lao vào “ăn sạch”…','LN',1,'102','102-1'),(299,'Về Chuyện Tôi Chuyển Sinh Thành Slime - Tập 2','NXB Dân Trí',2021,'Tiếng Việt','Cứ như vậy, cuối cùng thì Mikami Satoru, một thanh niên 37 tuổi với cuộc sống bình thường chẳng bao giờ gặp vấn đề gì to tát, kết quả giờ đây đã chuyển sinh thành một con slime và dần làm quen với cuộc sống, cũng như khám phá, sử dụng các năng lực của một slime chính hiệu tại dị giới.','LN',1,'102','102-1'),(300,'Toàn Chức Cao Thủ - Tập 1','NXB Hà Nội',2020,'Tiếng Việt','Thi đấu điện tử eSport đã không còn xa lạ với phần lớn người dân, đặc biệt là game online Vinh Quang với mười năm hình thành và phát triển. Trong mười năm đó có bao nhiêu tuyển thủ chuyên nghiệp đã rời đi bộ môn eSport này? Có người vì không kham nổi áp lực, có người vì lớn tuổi kỹ thuật không còn như xưa, lại cũng có người mang danh “Đấu Thần” lại bị chính nơi mình một tay xây dựng tên tuổi chèn ép đuổi đi. Đấu Thần giải nghệ, biết bao người rơi lệ, bao người tiếc nuối, bao người vẫn giữ trọn sự tôn trọng và lòng hâm mộ với tài năng của anh… Nhưng sự ra đi này là câu chuyện anh hùng mạt lộ hay sự khởi đầu của một truyền kỳ mới? Mọi sự mới chỉ bắt đầu…','TGTHBPL',1,'102','102-2'),(301,'Toàn Chức Cao Thủ (Tập 2)','NXB Hà Nội',2021,'Tiếng Việt','Tại server 10 mới mở của game Vinh Quang, mọi chuyện diễn ra khác hẳn lẽ thường bởi sự xuất hiện của một người: Diệp Tu - Huyền thoại giới chuyên nghiệp đã giải nghệ. Các thế lực, các công hội lớn đều đã có lựa chọn ứng phó cho riêng mình, Diệp Tu phải làm gì để nhân đó đạt được mục đích của riêng mình? Hắn sẽ gặp những ai, sẽ xử lý chuyện cũ thế nào và sắp xếp tương lai ra sao? Trong lúc than phận thực sự chưa bại lộ, những người quen trong giới chuyên nghiệp sẽ phản ứng thế nào khi nghe ngóng được hành tung của hắn? Diệp Tu vẫn đang bước từng bước trên con đường quay lại đỉnh vinh quang.','TGTHBPL',1,'102','102-2'),(302,'Biển Quái Vật (Phần 2 Series Percy Jackson Và Các Vị Thần Trên Đỉnh Olympus)(Tái Bản)','NXB Lao Động',2021,'Tiếng Việt','Năm lớp bảy của Percy Jackson trải qua một cách khá yên tĩnh. Không có một con quái vật nào đặt chân vào khuôn viên trường học của cậu ở New York. Nhưng khi trận đấu bóng ném bình thường giữa Percy và những người bạn cùng lớp của mình biến thành một trận đấu sống còn để chống lại một đám khổng lồ ăn thịt người xấu xí, mọi việc trở nên… ừm, xấu đi. Và sự xuất hiện bất ngờ của Annabeth, một người bạn của Percy, đã mang đến thêm nhiều tin xấu: vành đai phép bảo vệ Trại Con Lai đã bị đầu độc bởi một kẻ thù bí ẩn. Nếu không tìm được phương thức cứu chữa nó, nơi ẩn náu an toàn duy nhất dành cho các á thần sẽ bị tiêu diệt…','TGTHBPL',1,'102','102-2'),(303,'Percy Jackson Và Các Vị Thần Trên Đỉnh Olympus - Phần 3: Lời Nguyền Của Thần Titan (Tái Bản 2021)','NXB Lao Động',2021,'Tiếng Việt','Khi Percy Jackson nhận được cú điện thoại báo tin nguy cấp từ anh bạn Grover, cậu lập tức chuẩn bị cho cuộc chiến. Cậu biết mình cần có những người bạn á thần đồng minh, thanh kiếm Thủy triều bằng đồng đáng tin cậy, và… một chuyến đi nhờ xe của mẹ cậu. Các á thần nhanh chóng chạy đến giải cứu và phát hiện ra rằng Grover đã có một phát hiện cực kỳ quan trọng: hai người con lai hùng mạnh và không biết cha mẹ họ là ai. Nhưng đó không phải là tất cả những gì đang chờ đợi họ. Chúa tể các thần Titan, Kronos đã nghĩ ra âm mưu nguy hiểm nhất và các anh hùng trẻ tuổi đã rơi vào cạm bẫy đó.','TGTHBPL',1,'102','102-2'),(304,'Percy Jackson Và Các Vị Thần Trên Đỉnh Olympus - Phần 4: Cuộc Chiến Chốn Mê Cung (Tái Bản 2021)','NXB Lao Động',2021,'Tiếng Việt','Trong cuốn sách thứ tư của bộ sách bán chạy nhất này, thời gian đang ngày càng ít đi khi cuộc chiến giữa các vị thần trên đỉnh Olympus và người đứng đầu các thần Titan-Kronos ngày càng gần kề. Ngay cả nơi ẩn náu an toàn ở Trại Con Lai cũng dễ dàng bị công kích vào bất cứ lúc nào khi quân đội của Kronos đang tìm cách đi xuyên qua ranh giới phép thuật của trại. Để ngăn chặn điều đó, Percy và các người bạn á thần phải lên đường thực hiện cuộc tìm kiếm xuyên qua Mê Cung – một thế giới ngầm đầy hỗn độn, mang đến cho họ những sự kinh ngạc đầy choáng váng ở mỗi góc rẽ.','TGTHBPL',1,'102','102-2'),(305,'Vị Thần Cuối Cùng - Phần 5: Series Percy Jackson Và Các Vị Thần Trên Đỉnh Olympus (Tái Bản 2019)','NXB Văn học',2019,'Tiếng Việt','Trong cuốn sách quan trọng cuối cùng này, Lời Sấm Truyền chờ đợi đã lâu về ngày sinh nhật lần thứ mười sáu của Percy dần được hé lộ. Và khi cuộc chiến bảo vệ Nền Văn minh Phương Tây diễn ra ác liệt trên các đường phố ở Manhattan, Percy phải đối diện với một sự ngờ vực khủng khiếp rằng có thể cậu đang chiến đấu chống lại số phận của chính mình.','TGTHBPL',1,'102','102-2'),(306,'Percy Jackson Và Các Vị Thần Trên Đỉnh Olympus - Phần 4.5: Hồ Sơ Á Thần (Tái Bản 2021)','NXB Lao Động',2021,'Tiếng Việt','Hồ Sơ Á Thần gồm 3 câu chuyện phiêu lưu nguy hiểm nhất của Percy Jackson mà chưa từng được kể ra trước đây. Bạn sẽ nhận ra cách cậu ấy chạm trán với những người bất tử và các cậu con trai tồi tệ của thần Ares như thế nào. Bạn sẽ khám phá ra sự thật về con rồng bằng đồng, từ trước đến nay được xem là huyền thoại duy nhất ở Trại Con Lai. Và bạn sẽ khám phá ra cách thần Hades có được vũ khí bí mật mới như thế nào, và cách Percy bị ép buộc trở thành một phần trong cấu tạo của nó mà cậu ấy không nhận biết được. Những câu chuyện này được viết ra không phải để đe dọa các bạn, nhưng điều quan trọng là bạn nhận ra được rằng cuộc đời của một anh hùng có thể nguy hiểm như thế nào.','TGTHBPL',1,'102','102-2'),(307,'Chú khủng long của Nobita','NXB Kim Đồng',2021,'Tiếng Việt','Truyện theo chân hành trình phiêu lưu của Nobita và những người bạn cùng chú mèo máy tốt bụng tới từ tương lai Doraemon','TTMC',1,'101','101-1'),(308,'Nobita và lịch sử khai phá vũ trụ','NXB Kim Đồng',2021,'Tiếng Việt','Truyện theo chân hành trình phiêu lưu của Nobita và những người bạn cùng chú mèo máy tốt bụng tới từ tương lai Doraemon','TTMC',1,'101','101-1'),(309,'Nobita thám hiểm vùng đất mới','NXB Kim Đồng',2021,'Tiếng Việt','Truyện theo chân hành trình phiêu lưu của Nobita và những người bạn cùng chú mèo